INSERT INTO `f_article` VALUES ('9', '4', 'Е┬╥Ф√╟Д╩▀Г╩█', '<span style=\"font-weight:700;color:#333333;font-family:Е╝▀Д╫⌠, tahoma, arial, sans-serif;font-size:14px;line-height:28px;background-color:#FFFFFF;\">Е┬╥Ф√╟Ф≤╞Д╩─Д╧┬О╪÷Е┬╥Ф√╟Ф°┴Д╩─Д╧┬Е╔╫Е╓└О╪÷</span><br />\r\n<span style=\"color:#333333;font-family:Е╝▀Д╫⌠, tahoma, arial, sans-serif;font-size:14px;line-height:28px;background-color:#FFFFFF;\">Е┬╥Ф√╟Д©║Ф│╞Г⌡╦Е╫⌠Д╨▌Ф┌╗Ф┼┼Х©≥Д╦╙Д©║Ф│╞И┤█Ф√╟Е▐▒Е╦┐Д╦─Ф╛║О╪▄Д©║Ф│╞Д╪ Е├█Ф╛║Ф▌▓Е┬╟Х╞╔Г╠╩Е┬╚Е┬≈Х║╗И║╣И²╒Г └И²═Е┴█Д╫█Г╫╝Ц─┌&nbsp;</span><br />\r\n<br />\r\n<span style=\"font-weight:700;color:#333333;font-family:Е╝▀Д╫⌠, tahoma, arial, sans-serif;font-size:14px;line-height:28px;background-color:#FFFFFF;\">Е┬╥Ф√╟Ф─▌Д╧┬Ф⌠█Д╫°О╪÷</span><br />\r\n<span style=\"color:#333333;font-family:Е╝▀Д╫⌠, tahoma, arial, sans-serif;font-size:14px;line-height:28px;background-color:#FFFFFF;\">1Ц─│Г≥╩И≥├Д╦╙Д╨╨Х╢╕Ф┬╥О╪▄Г┌╧Е┤╩Д©╝Ф■╧Е┬═И≥╓Ф▄┴И▓╝О╪▄Х©⌡Е┘╔Г■╗Ф┬╥Д╦╜Е©┐Ц─┌</span><br />\r\n<img src=\"http://pic.lccz.com/app/fenlei/help/6fb53c51539b47559cf0d122a832cf63_1335592130.png\" alt=\"\" width=\"800\" /><br />\r\n<p style=\"color:#333333;font-family:Е╝▀Д╫⌠, tahoma, arial, sans-serif;font-size:14px;background-color:#FFFFFF;\">\r\n	<br />\r\n</p>\r\n<p style=\"color:#333333;font-family:Е╝▀Д╫⌠, tahoma, arial, sans-serif;font-size:14px;background-color:#FFFFFF;\">\r\n	2Ц─│Ф┴⌠Е╪─Ф°─Ф√╟Д©║Ф│╞О╪▄Г┌╧Е┤╩Е┬╥Ф√╟О╪⌡Ф╞▐Д╦╙Ф²©Е²≈Е┬╥Ф√╟Ф╛║Ф∙╟Д╦█Е░▄О╪▄Е┘╥Д╫⌠Х╞╢Ф≤▌Е▐╞Д╩╔Ф÷╔Г°▀Х╞╔Е┬├Г╠╩Г └Е┬╥Ф√╟Х╞╢Ф≤▌Ц─┌\r\n</p>\r\n<p style=\"color:#333333;font-family:Е╝▀Д╫⌠, tahoma, arial, sans-serif;font-size:14px;background-color:#FFFFFF;\">\r\n	<br />\r\n</p>\r\n<p style=\"color:#333333;font-family:Е╝▀Д╫⌠, tahoma, arial, sans-serif;font-size:14px;background-color:#FFFFFF;\">\r\n	<img src=\"http://pic.lccz.com/app/fenlei/help/833368d068c6dc956b62d9babf01c3b6_1335592224.png\" alt=\"\" width=\"800\" /> \r\n</p>\r\n<span style=\"color:#333333;font-family:Е╝▀Д╫⌠, tahoma, arial, sans-serif;font-size:14px;line-height:28px;background-c