INSERT INTO `f_article` VALUES ('19', '6', 'Х╜╕Ф┐∙И▓⌠И╠╪Г╫▒Г╚≥', '<p style=\"color:#333333;font-family:Е╝▀Д╫⌠, tahoma, arial, sans-serif;font-size:14px;background-color:#FFFFFF;\">\r\n	<span style=\"font-weight:700;\">Д╩─Д╧┬Ф≤╞И▓⌠И╠╪Г╫▒Г╚≥О╪÷</span><br />\r\nИ▓⌠И╠╪Г╫▒Г╚≥И─ Е╦╦Д╪╙Хё┘Ф┬░Д╦╨И⌠╤Х║▄Г╫▒Г╚≥Ц─│Ф╥≤Е╝²Е╨≈И⌠╨Г╜┴Х©≥Д╨⌡Е▐╞Д╩╔Е┬╘Г■╗Г╫▒Д╦┼Д╨╓Ф≤⌠Е╧╤Е╪∙Е╞╪Ф©─Е▐▒Г■╗Ф┬╥Г └Ф╤┬Х╢╧Х║▄ Д╦╨Г └Г╫▒Г╚≥О╪▄Г╙┐Е▐√Х╝©И≈╝Х─┘Ф▐░Д╨╓Г └Х╢╕Е▐╥Е▓▄Е╞├Г═│Д©║Ф│╞Ц─┌Е╝┐Д╦─Х┬╛И─ Х©┤Г■╣Е╜░И┌╝Д╩╤Д╪═Ф▓╜О╪▄Ф╜╓Г╠╩И┌╝Д╩╤Д╦╜Д╦─Д╦╙Г╩▐Х©┤Д╪╙Хё┘Г └И⌠╬Ф▌╔Е╟├Ф■╤Д╩╤Д╨╨Х│■Е┬╟И▓⌠И╠╪Г╫▒Г╚≥О╪▄Ф┬√Х─┘И─  Х©┤Д©║Ф│╞Е├┘Е╝╧И┤▄Е╦╕Ф°┴Г╫▒Г╚≥И⌠╬Ф▌╔Г └Х║▄Д╦╨Ф²╔Х╞╠Ф┐▒Г■╗Ф┬╥Х©⌡Е┬╟Х╞╔Г╫▒Г╚≥Д╦╜Ц─┌\r\n</p>\r\n<p style=\"color:#333333;font-family:Е╝▀Д╫⌠, tahoma, arial, sans-serif;font-size:14px;background-color:#FFFFFF;\">\r\n	<span style=\"font-weight:700;\">И▓⌠И╠╪Г╫▒Г╚≥Г └Е╦╦Х╖│Г └Г╠╩Е·▀</span><br />\r\nИ▓⌠И╠╪Г╫▒Г╚≥Г └И║╣И²╒Д╦▌Г°÷Е╝·Г╫▒Г╚≥Г∙▄И²╒Е╝▄Е┘╗Д╦─Х┤╢О╪▄Х╕│Ф╠┌Х╝©И≈╝Х─┘Ф▐░Д╨╓Х╢╕Е▐╥Е▓▄Е╞├Г═│Ц─┌Д╦─Х┬╛Ф²╔Х╞╢И▓⌠И╠╪Г╫▒ Г╚≥Г╩⌠Ф·└Е╬┬Г╝─Е█∙О╪▄Е▐╙Ф°┴Д╦─Д╦╙Ф┬√Е┤═Д╦╙И║╣И²╒О╪▄URLЕ▓▄Г°÷Е╝·Г╫▒Г╚≥Ф°┴Г╩├Е╬╝Е╥╝Е┬╚О╪▄И▓⌠И╠╪Ф°─Е╦╦Х╖│Г └О╪▄Д╦─Х┬╛Ф²╔Х╞╢Х©≤Ф≤╞И▓┬Е╞╧Ф╥≤Е╝²Г └Ф╞■Х╬┐Е╓ Ц─┌<br />\r\nЕ╕┌Г°÷Е╝·Г └Е╥╔Х║▄Г╫▒Г╚≥ Д╦╨www.icbc.com.cnО╪▄И▓┬Е╞╧Е╥╔Х║▄Г └И▓⌠И╠╪Г╫▒Г╚≥Е┬≥Ф°┴Е▐╞Х┐╫Д╦╨www.1cbc.com.cnЦ─┌<br />\r\nГ°÷Е╝·Г └Ф╥≤Е╝²Е╨≈И⌠╨Г └Г╫▒Е²─Д╦╨http://www.taobao.com/О╪▄И▓┬Е╞╧Ф╥≤Е╝² Г └И▓⌠И╠╪Г╫▒Г╚≥Е┬≥Ф°┴Е▐╞Х┐╫Ф≤╞ http://list.taobao.com/<br />\r\nhttp://ship.36165279taobao.com/<br />\r\nhttp://taobao.gegecn.com.cn<br />\r\nhttp://taobao0.com<br />\r\nhttp://w ww.taobaoxaq.com.cn/<br />\r\nhttp://www.Taobaveng.cn<br />\r\nhttp://www.paokn.com/taobao<br />\r\nhttp://www.teobao.com<br />\r\nhttp://www.taoob ao.com<br />\r\nhttp://taobaoa.w31.100dns.com/<br />\r\nhttp://www.taobaoy.com<br />\r\nhttp://taobao-hb.cn/<br />\r\nЕ╨■Х╞╔Г┴╧Е┬╚Е╟▐Е©┐Г■╠Д╦█Х╖└Х▄┐Г └Е╜≈Ф╞█Ф∙╟ Е╜≈Г╩└Ф┬░Г └CNГ╠╩Г╫▒Е²─О╪▄Ф°─Е╔╫Г╕│Ф╜╒Ф╣▐Х╖┬Е≥╗Х©░Х║▄JavaScriptЕ▓▄ActiveXД╩ёГ═│О╪▄Д╦█Х╕│Д╦┼Д╦─Д╨⌡Д╦█Е╓╙Д╨├Х╖ёГ └Г╫▒Г╚≥Ц─┌\r\n</p>\r\n<p style=\"color:#333333;font-family:Е╝▀Д╫⌠, tahoma,