INSERT INTO `f_article` VALUES ('20', '6', 'Е╦╦Х╖│И╙≈Е╜░Ф┴▀ФЁ∙Ф▐╜Г╖≤', '<h3 style=\"font-size:14px;font-weight:500;color:#333333;font-family:Е╝▀Д╫⌠, tahoma, arial, sans-serif;background-color:#FFFFFF;\">\r\n	И╙≈Е╜░Г └Е÷╨Ф°╛Ф┴▀Ф╝╣\r\n</h3>\r\n<p style=\"color:#333333;font-family:Е╝▀Д╫⌠, tahoma, arial, sans-serif;font-size:14px;background-color:#FFFFFF;\">\r\n	Д╦─Г⌡╢Д╩╔Ф²╔О╪▄Г╫▒Г╩°И╙≈Е╜░Е╠┌Е┤╨Д╦█Г╘╥О╪▄Д╫├Д╦┤Е▐≤Д╦█Г╕╩Е┘╤Е╝≈О╪▄И┐╫Ф≤╞Ф█╒Ф╠╓Д╦█Ф█╒Х█╞Г └Ф√╧ФЁ∙О╪▄Е▄√И╬≥Е╥╥Е┬├Г╠╩Д©║Ф│╞И─ Х©┤Е╞╧И╙≈Е╜░Г └Д╩■Г╩├Г═■Г╘╤О╪▄Д╦╨Е╧©Е╓╖Г■╗Ф┬╥Ф─╩Г╩⌠Д╦─Д╨⌡Х╖└Е╬▀Ф─╖ Г └Д╦°Х╔©О╪ \r\n</p>\r\n<p style=\"color:#333333;font-family:Е╝▀Д╫⌠, tahoma, arial, sans-serif;font-size:14px;background-color:#FFFFFF;\">\r\n	<span style=\"font-weight:700;\">1Ц─│</span>Е┤╨Е■╝Е∙├Е⌠│Е²┤Д╩╔Б─°Е┤╨Е■╝XXXX,Д╩╥Ф═╪XXXО╪▄Ф°┴Ф└▐Г └Е┼═QХ╞╕Х│┼Б─²Х©≥Д╨⌡Х╢╢Е╜░Е╓╖Е╝╤И┐╫Х╕│Е╟▐Е©┐Г∙≥Ф└▐Д╦─Д╦▀О╪▄Х─▄Д╦■Х©≥Д╨⌡Х╢╢Е╜░Е┤╨Ф┴─Е■╝Г └Е∙├ Е⌠│Д╩╥Ф═╪И┐╫Д╪ Ф╞■Е╦┌И²╒Д╦┼Д╬©Е╝°Х╝╦Е╓ О╪▄Х©≥Е╟╠Е╬≈Г∙≥Ф└▐Д╨├О╪▄Д╦█Х╕│Х╢╙Е⌡╬Е╟▐Д╬©Е╝°О╪▄Х╢╙Е╓ Е©┘ Е╓╠О╪│\r\n</p>\r\n<p style=\"color:#333333;font-family:Е╝▀Д╫⌠, tahoma, arial, sans-serif;font-size:14px;background-color:#FFFFFF;\">\r\n	<span style=\"font-weight:700;\">2Ц─│</span>И╙≈Е╜░И─ Е╦╦И┐╫Д╦█Д╪ Ф■╞Ф▄│Г╛╛Д╦┴Ф√╧О╪▄Е▐╙Д╪ Е┘┬Ф┴⌠Ф╛╬Ф┬√Х─┘Е┘┬Е∙├Е⌠│О╪▄Ф▐░Е┬╟Ф■╞Д╩≤Е╝²Ф┬√Х─┘Х╢╒Д╪ И─ Д╩─Д╧┬Г └Г╛╛Д╦┴Ф√╧Х╫╞Д╩╤Е╟╠Х╞╢Д╦█Д╪ Г■╗О╪▄Х©≥Ф≈╤ Е─≥Е╟╠Х╕│ФЁ╗Ф└▐Д╨├О╪▄Е╝│Е▐╞Е▐╕Е╞╩Х╖┘Д╦─Е▐╟О╪▄Д╧÷Д╦█Х╕│Е┘╣Х║▄И≥╘Г²─О╪│Х╝╓Г°÷Ф┐ЁД╦─Д╦▀Е┬╟Е╨∙Ф≤╞Д╨╨<br />\r\nЕ╝╤Г └Е∙├Е⌠│Е╔╫И┤█Х╕│Х©≤Ф≤╞Х┤╙Е╥╠Г └Х╬⌡Х▀╕И▓╠И┤█Х╕│О╪│\r\n</p>\r\n<p style=\"color:#333333;font-family:Е╝▀Д╫⌠, tahoma, arial, sans-serif;font-size:14px;background-color:#FFFFFF;\">\r\n	<span style=\"font-weight:700;\">3Ц─│</span>Ф÷░Д╨⌡И╙≈Е╜░Г └Ф┴▀ФЁ∙Ф°┴Д╦─Г┌╧Г┌╧И╚≤О╪┬Е┘╤Е╝·Д╧÷Д╦─Г°╪Е╟╠Х┐╫Г°▀Г╘©Г └О╪┴О╪▄Д╩√Д╩╛Ф┴▀Д╦┼Г║╝Е╝·Ф≤╞Ф°┴Е∙├Е⌠│О╪▄Д╫├Е╧╤Д╦█Ф≤╞Г°÷Г └Ф┐ЁЕ█√О╪▄Е▐╙Ф≤╞Г■╗Д╫°Х╞╠И╔╣О╪▄Е┘┬Ф┼┼Е∙├Е⌠│Г └Г┘╖Г┴┤Ф▀█Д╨├Д╦┼Ф²╔О╪▄Г└╤Е░▌И²≥Г╜┴Е╓╖И╠╪Д╦┼И▓⌠О╪▄Д╨╓Ф≤⌠Г └Ф≈╤Е─≥Х╕│Ф╠┌Е┘┬Ф╛╬Д╦─Е█┼О╪▄Г└╤Е░▌Х╞╢Д╪ Ф┼┼Е∙├Е⌠│И┌╝Г╩≥Д╫═О╪▄Ф╡║Ф°┴И≈╝И╒≤Е├█Ф┼┼Е▐╕Е╓√Д╦─Е█┼Г └И▓╠Г╩≥ Г └Ф┴⌠Х©┤Ф²╔О╪▄Х©≥Ф═╥Е╟╠Ф╜ёД╦╜Д╦▀Ф──Д╨├О╪▄Д╦█Х╕│Д╩╔Д╦╨Х┤╙Е╥╠Г └Ф²┐Г⌡┼Ф°┴Д╨├Д©²И °О╪▄Ф┐ЁД╦─Д╦▀Х┤╙Е╥╠Ф°┴Д╩─Д╧┬Е┬╘Г⌡┼Е▐╞Х╗─Е░╖О╪▄Д╦█Ф≤╞Х╒╚И╙≈Д╨├Е┘╗И┐╗О╪▄Х─▄Ф≤╞Х╒╚И╙≈Д╨├Д╦─Е█┼О╪│\r\n</p>\r\n<p style=\"color:#333333;font-family:Е╝▀Д╫⌠, tahoma, arial, sans-serif;font-size:14px;background-color:#FFFFFF;\">\r\n	<span style=\"font-weight:700;\">4Ц─│</span>Ф█╒Е∙├Е⌠│Ф┬√Х─┘Ф╠┌Е∙├Е⌠│Г └Х©≥Г╖█И╙≈Е╜░Д╧÷Д╪ И┤┤Г■╗Д╩╔Д╦┼Г └Ф√╧ФЁ∙О╪▄Г└╤Е░▌Х╞╢Д╨╓Ф≤⌠Ф√╧Е╪▐Г └Ф≈╤Е─≥Е╫⌠Г└╤Д╧÷Д╦█Д╪ И┤┤Г■╗Г╛╛Д╦┴Ф√╧Ф■╞Д╩≤О╪▄Х─▄Ф≤╞Х╕│Ф╠┌ Е┘┬Е∙├Е⌠│Е░▌Ф╛╬О╪▄Е┘┬Ф╛╬Д╦█Х║▄Е╟╠Д╪ Х╞╢Е▐╞Д╩╔Е╓╖Е╝╤Е░▄Ф≈╤Ф┼┼Е∙├Е⌠│И┌╝Е╞└Е┤╨Е▌╩О╪▄Х©≥Е╟╠Х╕│Г■╗Ф╜ё<br />\r\nХ╖└Г └И┌╝Е╞└Е┘╛Е▐╦Д╨╓Ф≤⌠Д╨├О╪▄Д╦█Х©┤Х©≥Г╖█Ф√╧ФЁ∙Г║╝Е╝·Ф≤╞Ф°┴О╪▄Е▐╙Ф≤╞Д╦┼Е╫⌠Г └Д╨╨ Е╨■Х╞╔Д╦█Д╪ Е╬┬Е╓ Е░╖~\r\n</p>\r\n<p style=\"color:#333333;font-family:Е╝▀Д╫⌠, tahoma, arial, sans-serif;font-size:14px;background-color:#FFFFFF;\">\r\n	<span style=\"font-weight:700;\">5Ц─│</span>Х©≤Ф°┴Д╦─Г╖█Е╟╠Ф≤╞И╙≈Е╜░Х╞╢Е©╚И─▓Е┘╛Е▐╦Д╩ёФ■╤Г └Д╦ Е┼║О╪▄Х©≥Д╧÷Ф≤╞Д╦█Е▐╞Д©║Г └О╪▄Ф╜ёХ╖└Г └Е©╚И─▓Е┘╛Е▐╦Е┤═Д╧▌Ф╡║Ф°┴Х©≥Г╖█Д╦ Е┼║Ц─┌\r\n</p>\r\n<h3 style=\"font-size:14px;font-weight:500;color:#333333;font-family:Е╝▀Д╫⌠, tahoma, arial, sans-serif;background-color:#FFFFFF;\">\r\n	Ф°─Е╝·Г■╗Г └И≤╡И╙≈Ф√╧ФЁ∙\r\n</h3>\r\n<p style=\"color:#333333;font-family:Е╝▀Д╫⌠, tahoma, arial, sans-serif;font-size:14px;background-color:#FFFFFF;\">\r\n	<span style=\"font-weight:700;\">1Ц─│</span>Ф°─Е╔╫Д╦─Е╝ Х╕│Е╫⌠И²╒Д╨╓Ф≤⌠О╪▄Х©≥Ф≤╞Ф°─Е╔╫Г └Д╨╓Ф≤⌠Ф√╧Е╪▐О╪▄И╙≈Е╜░Е┘╤Е╝·Ф≤▌Г÷╔И│⌠Д╫═Е▓▄Д╩√Д╦█Ф≤╞Д╦─Д╦╙Е°╟Ф√╧Г └О╪▄Ф┴─Д╩╔И╙≈Е╜░Д╦─Х┬╛Д╪ Е┘┬Ф▐░Е┤╨Х╕│Е╫⌠Ф┬░Д╨╓Ф≤⌠О╪▄Х©≥Ф═╥Е┘┬Х╝╘Д╫═Е©┐И┤▄Ф■╬Ф²╬Д╦─Д╦▀О╪▄Х╝╘Д╫═Х╖┴Е╬≈Д╩√Ф≤╞Г°÷Х╞ Г └О╪▄Е┘╤Е╝·Д╩√Ф═╧Ф°╛Е╟╠ Г÷╔И│⌠Д╫═Д╦█Е▐╞Х┐╫Х╥÷Д╩√Е╫⌠Ф┬░Д╨╓Ф≤⌠О╪▄Г└╤Е░▌Х©≤Д╪ И≈╝Д╫═Ф°┴Ф╡║Ф°┴Д╨╡Ф┬ Ф°▀Е▐▀Д╩─Д╧┬Г └ Е°╗И┌ёХ╬╧О╪▄Е┬┤Х╝╟О╪▄И│┤Е┬╟Х©≥Ф═╥Г └О╪▄Г⌡╢Ф▌╔Ф▀┴И╩▒Е░╖Ц─┌\r\n</p>\r\n<p style=\"color:#333333;font-family:Е╝▀Д╫⌠, tahoma, arial, sans-serif;font-size:14px;background-color:#FFFFFF;\">\r\n	<span style=\"font-weight:700;\">2Ц─│</span>Д╨╓Ф≤⌠Д╦─Е╝ Х╕│Г■╗Г╛╛Д╦┴Ф√╧Ф■╞Д╩≤Е╧ЁЕ▐╟О╪▄Х©≥Ф═╥Е╓╖Е╝╤И┐╫Ф°┴Д©²И °О╪▄Д╦█Ф■╞Ф▄│Г╛╛Д╦┴Ф√╧Г └Ф┬√Х─┘Д╦█Х┐╫Х╖│И²╒Д╨╓Ф≤⌠Г └Е╟╠Ф═╧Ф°╛Д╦█Х╕│Г░├Д╪ О╪▄Е▐╕Е╓√Е├█ Ф┴╬Е░╖О╪▄Х©≥Х┌╞Е╝ Ф≤╞И╙≈Е╜░Ц─┌\r\n</p>\r\n<p style=\"color:#333333;font-family:Е╝▀Д╫⌠, tahoma, arial, sans-serif;font-size:14px;background-color:#FFFFFF;\">\r\n	<span style=\"font-weight:700;\">3Ц─│</span>Е°╗Д╨╓Ф≤⌠Е┴█Ф°─Е╔╫Е┘┬Г≥╬Е╨╕Д╦─Д╦▀Е╞╧Ф√╧Г └QQЕ▐╥Г═│Ф┬√Х─┘Ф┴▀Ф°╨Е▐╥Г═│О╪▄Г╫▒Г╩°Д╦┼Д╦─Х┬╛И┐╫Г∙≥Ф°┴И╙≈Е╜░Г └Д©║Ф│╞Г └Ц─┌\r\n</p>\r\n<p style=\"color:#333333;font-family:Е╝▀Д╫⌠, tahoma, arial, sans-serif;font-size:14px;background-color:#FFFFFF;\">\r\n	<span style=\"font-weight:700;\">4Ц─│</span>Д╦█Х╕│Е▓▄Е╞╧Ф√╧Х│┼Г └Е╪─Е©┐Е╟╠Г╖╟Е┘└И│⌠Е╪÷Х─▄Е©≤Х╝╟Д╨├Х┤╙Е╥╠Г └Е┬╘Г⌡┼О╪▄Ф°┴Г └И╙≈Е╜░Е╟╠Д╪ Х©░Г■╗Е©┐Г░├Ф┬≤Ф°╞О╪▄Д╩▌Х╞╜Х╗─Д╦┼Е┘┬Х╝╘Д╫═Х╖┴Е╬≈Д╩√Е╬┬Г°÷Х╞  Х┐╫Х╝╘Д╫═Г⌡╦Д©║Д╩√О╪▄Д╦─Е╝ Х╕│Х╝╟Д╫▐О╪▄Ф┬▒Ф≤╞Е°╗Д╨╓Ф≤⌠О╪▄Х─▄Д╦█Ф≤╞Е°╗Д╨╓Ф°▀Е▐▀О╪▄Ф≈╤Е┬╩Х╕│Ф┼┼Е┬╘ Г⌡┼Ф▒├Е°╗Г╛╛Д╦─Д╫█О╪▄Е╝┴Е┘╗Д╨╓Ф≤⌠Ф┴█Ф≤╞Г║╛И│⌠Г░├Ц─┌\r\n</p>\r\n<p style=\"color:#333333;font-family:Е╝▀Д╫⌠, tahoma, arial, sans-serif;font-size:14px;background-color:#FFFFFF;\">\r\n	<span style=\"font-weight:700;\">5Ц─│</span>Д╦█Х╕│Д╩╔Д╦╨Е°╗Ф═║Е╜╕Г■÷Е╟╠Д╦█Д╪ Ф≤╞И╙≈Е╜░О╪▄Г▌╟Е°╗Е╬┬Е╓ И╙≈Е╜░И┐╫Ф≤╞Е╓╖Е╜╕Г■÷Е▒╒О╪▄Ф⌡╢Е╬≈Е╟▐Е©┐Х╟╗Ф┘▌Ц─┌\r\n</p>\r\n<p style=\"color:#333333;font-family:Е╝▀Д╫⌠, tahoma, arial, sans-serif;font-size:14px;background-color:#FFFFFF;\">\r\n	<span style=\"font-weight:700;\">5Ц─│</span>И┌╝И─▓Ф√╧Е╪▐Д╦─Е╝ Х╕│Г■╗Ф╜ёХ╖└Г └И┌╝И─▓Е┘╛Е▐╦О╪▄Д╬▀Е╕┌EMSЦ─│И║╨Д╦╟Ц─│Г■ЁИ─ Г╜┴Г╜┴Ц─┌\r\n</p>\r\n<p style=\"color:#333333;font-family:Е╝▀Д╫⌠, tahoma, arial, sans-serif;font-size:14px;background-color:#FFFFFF;\">\r\n	<span style=\"font-weight:700;\">6Ц─│</span>Г╛╛Д╦┴Ф√╧Д╨╓Ф█╒Е∙├Е⌠│Х≥╫Г└╤И╨╩Г┐╕О╪▄Д╫├Х©≥Ф≤╞И≥╓Д╨├И²╒Д╨╓Д╧▀Е╓√Г └Ф°─Е╝┴Е┘╗Г └Д╨╓Ф≤⌠Ф√╧ФЁ∙О╪▄Е⌡═Д╦╨Х╕│Х╣╟ФЁ∙Е╬▀Г╗▀Е╨▐О╪▄Ф┴─Д╩╔Д╦─Е╝ Д╪ Ф°┴Ф≈╤И≈╢Д╦┼Г └ Х─╫Х╞╞О╪▄Д╫├Д╦─Е╝ Е┬┤Х╝╟О╪▄Х©≥Ф═╥Ф┴█Д╦█Д╪ Х╒╚И╙≈Ц─┌\r\n</p>', '', '1459730130', '2');
INSERT INTO `f_article` VALUES ('21', '6', 'Д╨▓Х│■Г╫▒И≤╡И╙≈Ф▄┤Е█≈', '<span style=\"color:#333333;font-family:Е╝▀Д╫⌠, tahoma, arial, sans-serif;font-size:14px;line-height:28px;background-color:#FFFFFF;\">И┌╝Д╩╤Г÷╜Д©║Е│┤И⌠╬Ф▌╔</span><br />\r\n<br />\r\n<span style=\"color:#333333;font-family:Е╝▀Д╫⌠, tahoma, arial, sans-serif;font-size:14px;line-height:28px;background-color:#FFFFFF;\">1.Г÷╜Д©║Х╞┬И╙≈Х─█Х┼╠Ф═╥ И╙▄Х╞│Ф┴▀Ф°╨Е│╥Е╞├Г═│</span><br />\r\n<span style=\"color:#333333;font-family:Е╝▀Д╫⌠, tahoma, arial, sans-serif;font-size:14px;line-height:28px;background-color:#FFFFFF;\">Г╙│Г└╤Ф■╤Е┬╟Ф²║Б─°ГЁ╩Г╩÷Б─²Г÷╜Д©║Х╞╢И╙▄Х╞│Ф┴▀Ф°╨И∙©Ф°÷Ф°╙И╙▄Х╞│И°─Х╕│И╙▄Х╞│О╪▄Х╕│Е⌡·Е╓█Х╢╕Ф┬╥Е╞├Г═│Г └Г■╗Ф┬╥Ф⌡╢Х╕│ФЁ╗Ф└▐Д╨├О╪▄Е▄√И╬≥Е╥╥Е┬├Г╠╩Д©║Ф│╞Ф≤╞Д╦█Д╪ Е▐▒И─│Д╩╩Д╫∙Х╕│Ф╠┌Г■╗Ф┬╥Е⌡·Е╓█Х╢╕Ф┬╥Е▓▄Е╞├Г═│Г └Г÷╜Д©║Г └Ц─┌</span><br />\r\n<br />\r\n<span style=\"color:#333333;font-family:Е╝▀Д╫⌠, tahoma, arial, sans-serif;font-size:14px;line-height:28px;background-color:#FFFFFF;\">2.Г┴╧Д╩╥Ф°╨Г╔╗Ф╩║Е╓╘Иё· Х╫╛Х╢╕Е╔≈И▓╠Г▌╟Е▌÷Е╫╒</span><br />\r\n<span style=\"color:#333333;font-family:Е╝▀Д╫⌠, tahoma, arial, sans-serif;font-size:14px;line-height:28px;background-color:#FFFFFF;\">И ▐Г²─Ф≤╔Х©░Е╓╖Е╧∙Г └Ф▀┴Е╪─О╪▄Б─°Г┴╧Д╩╥Ф°╨Г╔╗Б─²Ф┌└Г└╤Ф┬░Д╦╨Ф░°Г╢╒Г┐╜И≈╗Х╞█Ф╠┤О╪▄Б─°Е│┤Ф°╨Г╔╗Г╫▒Б─²Д╧÷Х©▌Ф²╔Д╨├ Х┤╙Е╥╠Г └Б─°Ф≈╨Е╜ёБ─²Ц─┌Д╦█ФЁ∙Е┬├Е╜░Е╦╦Д╩╔Х╤┘Д╫▌Ф┼≤Ф┴ёЕ╪∙Х╞╠Ф╤┬Х╢╧Х─┘Х╝╒Г╔╗О╪▄И╙≈Е▐√И▓╠Х╢╒О╪▄Г■ Х┤ЁГ⌡╢Ф▌╔Е╔≈Е▐√Г■╗Ф┬╥Г └И⌠╤Х║▄Х╢╕Ф┬╥Е▓▄Е╞├Г═│Ц─┌Д╦█Х╕│Д╦╨Х╢╙Е⌡╬Д╦─Г┌╧Е╟▐Д╬©Е╝°Е╞╪Х┤╢Е█Ё Ф█÷Е╓╠Д╨├И▓╠Х╢╒О╪▄Д╧÷Д╧╟Д╦█Е┬╟Е⌡·Е╝╤Х©┤Е╧╢Г └И┌ёЕ╪═Б─°И─ Х║▄Х╞│Б─²Ц─┌Д╦╨Д╨├Е╓╖Е╝╤Е▐╞Д╩╔Е©╚Е©╚Д╧░Д╧░Г └Х©┤Д╦─Д╦╙Ф╛╒Е╨├Г └Ф√╟Е╧╢О╪▄Х╞╥Е╓╖Е╝╤Е╓ Е┼═ФЁ╗Ф└▐Д╨├Ц─┌</span><br />\r\n<br />\r\n<span style=\"color:#333333;font-family:Е╝▀Д╫⌠, tahoma, arial, sans-serif;font-size:14px;line-height:28px;background-color:#FFFFFF;\">3.Х╟│Х╞╢Х╢╕Е▐╥Ф°┴Е╪┌Е╦╦ Е▌÷Ф≤╞И╙≈Е╜░Ф┐ЁИ▓⌠И╠╪</span><br />\r\n<span style=\"color:#333333;font-family:Е╝▀Д╫⌠, tahoma, arial, sans-serif;font-size:14px;line-height:28px;background-color:#FFFFFF;\">И ▐Г²─Г▌╟Е°╗И╙≈Е╜░Е╞╧Д╨▓Х│■Г╫▒Х╤┼Ф²╔Х╤┼Г├÷Ф┌┴О╪▄Е░└Г╖█Ф√╟Ф▀⌡Е╪▐Е╠┌Е┤╨Д╦█Г╘╥О╪▄Е├▓Е┘┘Е▄√И╬≥Е╥╥Е┬├Г╠╩Д©║Ф│╞Г╩≥Е╝╒Ф┬╥Е▐▒И─│И▓⌠И╠╪И┌╝Д╩╤Е╟╠Ф≤╞Д╦─ Д╦╙Ф√╟Д╬▀Е╜░О╪▄Х╞╥Е╓╖Е╝╤Д╦█Х╕│Г⌡╦Д©║Х╕│Ф╠┌Д╫═Е║╚Е├≥Е▄√И╬≥Е╥╥Х╢╕Ф┬╥Е╞├Г═│Г └И┌ёД╨⌡И┌╝Д╩╤О╪▄Е▄√И╬≥Е╥╥Е┬├Г╠╩Д©║Ф│╞Ф≤╞Д╦█Д╪ Х╕│Ф╠┌Ф┌╗Е°╗И┌╝Д╩╤Д╦╜Е║╚Е├≥Х©≥Д╨⌡Д©║Ф│╞Г └О╪▄И┌ёД╨⌡И┐╫Ф≤╞И╙≈Е╜░Г └И┌╝Д╩╤О╪▄Е▐╙Х╕│ Ф┌╗Е║╚Е├≥Д╦▀Е▌╩Е╟╠Д╪ Х╒╚И┌ёД╦╙Е▐▒Х©≥Д╦╙И┌╝Д╩╤Г └Д╨╨Д©╝Ф■╧Ф┌╗Г └Е╞├Г═│Г └О╪▄Х╢╕Ф┬╥Ф°┴Д╫≥И╒²Г └Е╝╒Ф┬╥Е╟╓Е┘╤Х╕│ФЁ╗Ф└▐Д╨├Ц─┌</span><br />\r\n<br />\r\n<span style=\"color:#333333;font-family:Е╝▀Д╫⌠, tahoma, arial, sans-serif;font-size:14px;line-height:28px;background-color:#FFFFFF;\">4.Е▒╗Е╧╢Е╨├Е┘╦Х╒╚Г┌▓Д╫° Д╦╜Е╔√Ф╛╨Х╞┬Х╕│Ф▐░И≤╡</span><br />\r\n<span style=\"color:#333333;font-family:Е╝▀Д╫⌠, tahoma, arial, sans-serif;font-size:14px;line-height:28px;background-color:#FFFFFF;\">Е▄√И╬≥Е╥╥Е┬├Г╠╩Д©║Ф│╞Д╦█Д╪ Г╩≥Г■╗Ф┬╥Е▐▒И─│И┌╝Д╩╤Х╝╘Г■╗Ф┬╥Е▌╩Е▐┌Е┼═Ф┴─Х╟⌠ Г └Б─°Г▀┌Ф╛╒Б─²Ц─┌Ф┴─Д╩╔Е╓╖Е╝╤Х╕│ФЁ╗Ф└▐Х©≥Г╖█И┌╝Д╩╤Д╨├Е⌠╕Ц─┌</span>', '', '1459730186', '3');
