INSERT INTO `f_info` VALUES ('21', '3', '166', '17Е╞╦Ф╤╡Ф≥╤Е▐╟Е╪▐Г■╣Х└▒Е┤╨Е■╝', 'Ф°╛Д╨╨Г▌╟Ф°┴Д╦─Е▐╟Е▐╟Е╪▐Г■╣Х└▒Е┤╨Е■╝О╪▄Г■╣Х╞²О╪ &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<br />\r\nИ┘█Г╫╝Е╕┌Д╦▀О╪ &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<br />\r\n17Е╞╦Ф╤╡Ф≥╤Ф≤╬Г╓╨Е≥╗&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<br />\r\nCPUО╪ AMD2800+&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<br />\r\nЕ├┘Е╜≤Ф²║О╪ И┤▒Её╚И║©1G&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<br />\r\nГ║╛Г⌡≤О╪ Х©┬Ф▀⌠160G&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<br />\r\nФ≤╬Е█║О╪ Г▀╛Г╚▀7300&nbsp;GF&nbsp;Ф≤╬Е█║&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<br />\r\nГ▌╘Ф╦╦Ф┬▐О╪┬И╜■Е┘╫Ц─│CFЦ─│Е°╟Д╦▀Е÷▌Е▀┤Её╚Ц─│Ф°╨Ф┬≤Ц─│Е┼╡Х┬·Е⌡╒Ц─│Е█║Д╦│Х╫╕Г╜┴О╪┴И┐╫Д╦█Е█║О╪▄Е┼·Е┘╛Х╫╞Д╩╤О╪┬Office&nbsp;2007Ц─│Г╫▒И║╣Д╦┴Е┴▒Е╝╒Ц─│visual&nbsp;studio&nbsp;2008Г╜┴О╪┴И┐╫Д╦█Ф┬░И≈╝И╒≤Ц─┌Г┌▓Х┌║Ц─│Е╜╕Д╧═Ц─│Е┼·Е┘╛Х╤ЁД╩╔О╪│&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<br />\r\nД╩╥Ф═╪О╪ 1200Е┘┐', '', '0', '1287750732', '1381389468', '#f54100', 'Е╟▐Г▌▀', '15006570631', '120885811', '127.0.0.1', '1136', '1');
INSERT INTO `f_info` VALUES ('25', '3', '27', 'Д╫▌Д╩╥Е┤╨Х┤╙Г■╗Х┐╤Г┴┤Г⌡╦Ф°╨Ф╣╥И╦╔DF2000О╪▄И∙©Г└╕', 'Е╬┬Е╔╫Г■╗Г └Е█∙Е▐█Г⌡╦Ф°╨О╪▄И┘█tokins&nbsp;Г°▀Д╦█Х╖│О╪÷Х╞╥Е┬╥Ф√╟.Е°╟Е╝²Г╫▒mmИ∙©Г└╕И∙°Е╓╢Д╦─Д╦╙Е╦╕И∙°Е╓╢Е┴█Г⌡√О╪▄kenko&nbsp;uvИ∙°Д╦─Д╦╙О╪▄И∙°Е╓╢Е├┘Е╟▒И┤▐И°┴Г┌╧Д╫├Е╧╤Д╦█Е╫╠Е⌠█Ф┬░Е┐▐Х╢╗И┤▐Ц─┌Г⌡╦Ф°╨Ф─╖Х┐╫Е╝▄Е╔╫О╪▄Е├┘И┐╗Ф╣▀Е┘┴Е┤├Г║╝О╪▄И─┌Е░┬Е┘╔И≈╗Е█∙Е▐█Г └Г╩┐Д╧═Х─┘О╪▄Ф■╤Х≈▐Д╨╕Е▐╞Ц─┌&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<br />\r\nД╩╥Ф═╪Д╦█Е┬─О╪▄Г┬╫Е©╚Х─┘И─│И≈╙Е┘┴Г│╞О╪│', '', '0', '1273644355', '1259674818', '', 'Х┐║Е┘┬Г■÷', '15006570631', '120885811', '127.0.0.1', '110', '1');
INSERT INTO `f_info` VALUES ('26', '3', '28', '01Е╧╢Е░┴Е┬╘Х╫©Х╫╕Д╦╓Е▌╒Х╫╛Х╝╘', 'И²·Х░╔Х©░О╪▄Ф┴▀Г╩╜И╫░Е┘╗О╪▄Х╫╕Е├╣Х┴╞Е╔╫О╪▄Г╨╒Х┴╡Х╫╕Х╨╚О╪▄И⌠╤Х┴╡Хё≥Х╬╧Ц─┌Е⌡═Ф°╛Д╨╨Ф█╒И²╒Е▄┘Х╫╕Х╫╛Х╝╘Ц─┌Е■╝Д╩╥9500Е┘┐О╪▄Д╦█Х╞ Ф┬√Д╦╜Д╩▀Е▀©Ф┴╟', '', '0', '1259761301', '1259674901', '', 'Е╟╧Е┘┬Г■÷', '13355168097', '', '127.0.0.1', '22', '1');
INSERT INTO `f_info` VALUES ('27', '3', '29', 'Е╓╘Г©╪Ф┴▀Ф°╨И∙©Х│┼Е█║/Д╦╜Е⌡╫Г■╣Д©║Ф≈═Г╨©Е⌡╨Е╝ Г■╣Х╞²', 'Д╦╜Е⌡╫Г■╣Д©║Ф≈═Г╨©Е⌡╨Е╝ Г■╣Х╞²(CDMA)&nbsp;&nbsp;&nbsp;<br />\r\nГ■╗Д╨▌133&nbsp;153&nbsp;189Е█║&nbsp;&nbsp;&nbsp;<br />\r\nИ─┌Г■╗Е╞╧Х╠║:&nbsp;Е╝╤Е╨╜Г■╗Ф┬╥&nbsp;Е∙├И⌠╨Г■╗Ф┬╥&nbsp;Д╩⌠Е╨⌠Г■╣Х╞²&nbsp;&nbsp;&nbsp;<br />\r\n&nbsp;&nbsp;&nbsp;<br />\r\nЕ█▌Д╦╨ETS2222+Ф≈═Г╨©Г╖╩Е┼╗Г■╣Х╞²Ф°╨(Д╩┘И≥░Е█≈Ф≤▄Е°╟Е▄╨Х╢╜Д╧╟)&nbsp;&nbsp;&nbsp;<br />\r\nД╦╨Ф√╧Д╬©Е╧©Е╓╖Д╪│Д╦ Е▓▄Д╫▐Ф┬╥Г └И°─Ф╠┌О╪▄Е█≈Ф≤▄Г■╣Д©║Е┘╛Е▐╦Г▌╟Ф▌╗Е┤╨Е╓╘Г©╪Е∙├Х╞²О╪▄Е╝┴Хё┘Г■╣Х╞²Ф°┴Д╨├Ф√╟Г └И─┴Ф▀╘О╪│О╪│О╪│Е█▌Д╦╨CDMAФ≈═Г╨©Е⌡╨Х╞²О╪▄И╒└Е╜≤350Е┘┐Х╞²Х╢╧О╪▄Е╟╠Е┘█Х╢╧И─│Д╦─И┐╗Ф≈═Г╨©Е╨╖Ф°╨О╪│О╪│&nbsp;&nbsp;&nbsp;<br />\r\n&nbsp;&nbsp;&nbsp;<br />\r\nБ≤┘&nbsp;Е░╚350Е┘┐Х╞²Х╢╧О╪┬И╕√Ф╛║Е┬╟Е╦░50Е┘┐О╪▄Ф╞▐Ф°┬Х©■Х©≤15Е┘┐О╪▄Е┬├20Д╦╙Ф°┬Х©■Х©≤О╪┴&nbsp;&nbsp;&nbsp;<br />\r\nБ≤┘&nbsp;Ф≈═Ф°┬Г╖÷О╪▄Е╦┌Х╞²И∙©И─■Е²┤0.1Е┘┐/Е┬├&nbsp;&nbsp;&nbsp;<br />\r\nБ≤┘Е╨╖Ф°╨Х©≤Е▐╞Д╩╔Ф■╤Е▐▒Г÷╜Д©║(0.1Е┘┐/Ф²║)&nbsp;&nbsp;&nbsp;<br />\r\nБ≤┘&nbsp;Ф≈═И°─Ф▀┴Г╨©О╪▄Е█ЁД╧╟Е█ЁГ■╗Ф√╧Д╬©Е©╚Ф█╥&nbsp;&nbsp;&nbsp;<br />\r\nБ≤┘Е▐╞Е╪─И─ Д╪│Д╦ Д╦╙Ф─╖Е╫╘И⌠┐&nbsp;&nbsp;&nbsp;<br />\r\nД╦─Ц─│Д╦ Е┼║Г╝─Д╩▀&nbsp;&nbsp;&nbsp;<br />\r\nЕ╓╘Г©╪Е∙├Х╞²Д╦ Е┼║Ф≤╞Е°╗Е█≈Ф≤▄Г■╣Д©║Ф▌╗Е┤╨Д╦─И║╧Е┘╗Ф√╟Д╦ Е┼║О╪▄Г╩┬Г╚╞Г └Е╓√Е╫╒Г╠╩Д╪╪Д╪═Г╩÷Г └Е⌡╨Е╝ Г■╣Х╞²Ф°╨О╪▄Е┬²Ф°÷Г╩÷Д╦─Г╩┬Г╚╞Е·▀Е▐╥Д╦╨Е█▌Д╦╨ETS2222+Ц─┌Ф≈═И°─Е╝╓Е├┘Е╦┐Г╨©О╪▄Е▐╞Х╠║Ф┴▀Ф°╨Д╦─Ф═╥И ▐Ф└▐Г╖╩Е┼╗Ц─┌&nbsp;&nbsp;&nbsp;<br />\r\nД╨▄Ц─│Е╝ёД╪═Е█√Г┌╧&nbsp;&nbsp;&nbsp;<br />\r\n1Ц─│Х╝╘Б─°Е⌡╨Е╝ Г■╣Х╞²Б─²Е┼╗Х╣╥Ф²╔О╪ &nbsp;&nbsp;&nbsp;<br />\r\nБ≈▐Е▐╞Г╖╩Е┼╗Г └Е⌡╨Е╝ Г■╣Х╞²О╪▄Ф°─Е╓╖И≥░Е╨╕Е°╟Ф╩║Х╤ЁГ■╗Ф┬╥Д╫©Г■╗Ф║▄И²╒Г■╣Х╞²Г └Д╧═Ф┐╞О╪⌡&nbsp;&nbsp;&nbsp;<br />\r\nБ≈▐Г╖╩Ф°╨Д╦█Ф█╒Е▐╥О╪▄И▓┬Е╞╧Г■╗Ф┬╥Е▐╞Х┐╫И╒▒Г╧│Е▐≤Ф█╒Е┼·Е┘╛Е°╟Е²─Ц─│Е▐≤Ф█╒Г╩▐Х░╔Е°╨Ф┴─О╪▄Е╦╝Е┼╘Г■╗Ф┬╥Ф▒├Х└╠Ф°┴Г╨©Г └Ф²÷Г╪ О╪▄Х╫╩Ф²╬Д╨╚Е▐≈Е©╚Д╧░Ф≈═И≥░Г └И─ Д©║Ф√╟Г■÷Ф╢╩О╪⌡&nbsp;&nbsp;&nbsp;<br />\r\nБ≈▐Ф≈═И°─Е╝╓Е├┘Е╦┐Г╨©О╪▄Е▐╞Е╝▄Е┘╗Д©²Ф▄│Ф┌╗Е╝╓Е├┘Ф∙╢Ф╢│Г╬▌Х╖┌Ц─┌&nbsp;&nbsp;&nbsp;<br />\r\n2Ц─│Х╤┘Д╫▌Х╞²Х╢╧О╪ &nbsp;&nbsp;&nbsp;<br />\r\nБ≈▐Ф≈═Е┬²Хё┘Х╢╧О╪▄Е█ЁД╧╟Е█ЁГ■╗О╪⌡&nbsp;&nbsp;&nbsp;<br />\r\nБ≈▐0Ф°┬Г╖÷О╪⌡&nbsp;&nbsp;&nbsp;<br />\r\nБ≈▐Е╦┌Х╞²И∙©И─■Д╦─Д╦╙Д╩╥О╪ 0.1Е┘┐/Е┬├И▓÷&nbsp;&nbsp;&nbsp;<br />\r\nБ≈▐Е╨╖Ф°╨Д╧÷Х┐╫Е▐▒Г÷╜Д©║Ц─┌&nbsp;&nbsp;&nbsp;<br />\r\n4Ц─│И╒└Е╜≤Х╞²Х╢╧Ц─│Г≥╫Ф▀©Х╞²Ф°╨Ц─┌&nbsp;&nbsp;&nbsp;<br />\r\nД╦┴Ц─│Г╩┬Г╚╞Е■╝Е░▌Ф°█Е┼║Ф╣│Г╗▀&nbsp;&nbsp;&nbsp;<br />\r\n1Ц─│Е■╝Е░▌Ф°█Е┼║Ф═┤Е┤├О╪ Д©²Д©╝Ф²║Ф╛╬Е▓▄И≥░Е┬╤Д©²Д©╝Ф²║Ф╛╬О╪▄Е▐┌И≤┘Д╦ Е┼║И─ Г÷╔Ц─┌&nbsp;&nbsp;&nbsp;<br />\r\n2Ц─│Е■╝Е░▌Ф╣│Г╗▀О╪ Е╕┌Е┤╨Г▌╟Ф∙┘И °О╪▄Г╩÷Д╦─Е┬╟Е█≈Ф≤▄Г■╣Д©║Ф┴▀Ф°╨Г╩╢Д©╝Ф°█Е┼║Д╦╜Е©┐Х©⌡Х║▄Фё─Ф╣▀Ц─│Ф█╒Ф°╨Ц─┌&nbsp;&nbsp;&nbsp;<br />\r\n3Ц─│Е█▌Д╦╨Е╝╒Ф┬╥Ф°█Е┼║Г┐╜Г╨©Г■╣Х╞²О╪ 800&nbsp;830&nbsp;8300&nbsp;/&nbsp;4008&nbsp;308&nbsp;300О╪⌡&nbsp;&nbsp;&nbsp;<br />\r\n4-Д©┐И■─Ф√╧Ф║┬&nbsp;&nbsp;&nbsp;<br />\r\nГ■╗Ф┬╥И╒└Е╜≤350Е┘┐Х╞²Х╢╧О╪▄Е┘█Х╢╧Х▌╥Е╬≈Д╦─И┐╗Г╩┬Г╚╞О╪▄И╕√Ф╛║Е┬╟Х╢╕50Е┘┐О╪▄Е┘╤Д╫≥300Х╞²Х╢╧Е┬├20Д╦╙Ф°┬Х©■Х©≤Е┬╟Г■╗Ф┬╥Г └Х╢╕Ф┬╥О╪▄Ф╞▐Ф°┬Ф°┬Е┬²Х©■Х©≤15Е┘┐Ц─┌&nbsp;&nbsp;&nbsp;<br />\r\nИ╒└Е╜≤Х╞²Х╢╧&nbsp;Х╣═Ф°╨Ф╢╩Е┼╗&nbsp;И╒└Е╜≤Х╞²Х╢╧Х©■Х©≤Ф√╧Е╪▐&nbsp;Х╣═И─│Е╒·Е─╪Д╦ Е┼║', '', '0', '1267450922', '1268785001', '', 'Г├┼Е┘╣Е┘╣', '13307910512', '', '127.0.0.1', '35', '1');
