INSERT INTO `f_info` VALUES ('32', '3', '30', 'Е╔┬Х┴╞Г╬▌Ф≥╨Д╫°Е⌠│Б─°Ф╒╕Ф╦╦Е╗┐Е╗┐Б─²Ф┐┘Д╨╨Х┼┌Ф°─Е░▌Ф┐┼Е√°О╪│', 'Е┼╗Ф─│Г └Е⌠╕&nbsp;<br />\r\n<br />\r\nД╦┼Ф╣╥Х╥╞Х┌╞Е╬╥Е÷╨Ф≈│Ф═╪Е╜░И⌠╨Д╦┼Х╢╖Е┤╨Е■╝Д╦╜Ц─┌Ц─┌Ф╛╒Х©▌Е╓╖Е╝╤Г┐╜Г┐┬Ф┼╒Х╢╜Е⌠╕О╪│&nbsp;Х│■ГЁ╩Ф°╛Д╨╨Е▐╞Д╪≤Ф┐═<br />\r\n<br />\r\nЦ─░Ф²░Х╢╗Ц─▒И╚≤Ф║ёФ░╙Х┐╤<br />\r\nЦ─░Е╟╨Е╞╦Ц─▒Г╚≥И╚≤Г╨╕26cm+И─▐Ф≤▌Г╓╪Г⌡▓Е▄┘Хё┘<br />\r\nЦ─░Г┴╧Д╩╥Ц─▒138Е┘┐/Е▐╙<br />\r\nЦ─░Х╞╢Ф≤▌Ц─▒Ф╜╓Ф╛╬Е╗┐Е╗┐Д╦╨Е┼╗Ф─│Г └О╪▄Е╬─Е░▌Ф▀┴Д╦─Д╦▀О╪▄И┤▄Х╬╧Г └Е▐▒Ф²║Е╟╠Г╩╥Г╢╖Д╨├О╪▄Х│ И⌡├Д╨├Х┐╫И┤▐О╪▄Ф┴▀Ф■╬Д╨├Д╧▀Е░▌О╪▄Е╔╧Е╟╠Д╪ Е╬─Е┴█Х╥▒Ц─┌Ф┴─Д╩╔Д╦█И°─Х╕│Г■╣Ф╠═Ц─┌Е▐╕Е╓√О╪▄И╒°Х┴╡Ц─│Ф═╥Е╪▐Ц─│Е╓╖Е╟▐Ц─│Е▄┘Хё┘Г╜┴Е▓▄Ц─┼Х°≈Е╠┘Ц─▀И┤▄Г └Е╝▄Е┘╗Д╦─Ф═╥О╪│<br />\r\nБ─■Б─■Б─■Б─■Б─■Б─■Б─■Б─■Б─■Б─■Б─■Б─■Б─■Б─■Б─■Б─■Б─■Б─■Б─■Б─■<br />\r\n<br />\r\nЕё╟Ф≤▌О╪ Х©≥Ф≤╞И╚≤Д╩©Г┴┬Г └О╪▄Д╦█Ф≤╞Ф╜ёГ┴┬Г └О╪▄Ф╜ёГ┴┬Г └Е°╗Е╦┌Е°╨Д╦┼Е╥╡Г╩▐Ф╡║Ф°┴И■─Е■╝Д╨├О╪▄Д╩╥Е─╪Е°╗Е┘┐Е╥╕Е▐ЁО╪▄Е╠·Д╨▌Г╗─Ф°┴Ф■╤Х≈▐Е⌠│Ц─┌<br />\r\n<br />\r\nИ─│Е°├Г╜▓И─▐Ф≤▌Г⌡▓О╪▄Е╓√Е▄┘И┐╫Г■╗Ц─┌<br />\r\n<br />\r\nЕ╕┌Ф·°Ф°┴Ф└▐Х╢╜Д╧╟,Е▐╞Д╦▌Ф┬▒Г■╣Х╞²Х│■ГЁ╩&nbsp;О╪│О╪│<br />\r\nЕ╦┌Е├┘Е┼═О╪┬10Е┘┐О╪┴Е▐╞Х─┐Х≥▒И─│Х╢╖Д╦┼И≈╗Ц─┌', '', '0', '1278135068', '1265243690', '', 'Е╟▐Х┴╞', '13576039972', '', '127.0.0.1', '30', '1');
