INSERT INTO `f_info` VALUES ('37', '3', '533', 'И∙©Ф°÷Ф▀⌡Ф■╤Г╬▌Г■╡Е╜╕Е▒≤О╪▄Ф┬░Г╩╘Д╪≤Е╪┌Е▐╞Ф▌╗Х█░Е╥╔Д╫°', 'Д╫═Х©≤Е°╗Д╦╨Ф┴╬Е╥╔Д╫°Ф▀┘Е©╖Е░≈О╪÷Х©≤Е°╗Д╦╨Г■÷Х╝║Е╔■ФЁ╒Е░≈О╪÷Х©≤Е°╗Д╦╨Е┬⌡Д╦ И║╧Г⌡╝Е▐▒Ф└│Е░≈О╪÷Е©╚Е©╚Е┼═Е┘╔Ф┬▒Д╩╛Х©≥Д╦╙Г╬▌Д╦╫Г └Д╨▀Д╦ О╪│Г▌╟Е°╗Е┘╗Е⌡╫Г╬▌Г■╡Х║▄Д╦ Е╥╡Г╩▐Е╫╒Ф┬░Х╖└Ф╗║О╪▄Д╦ Е├┘Г╬▌Г■╡Е╦┬Е╔┤Г╪╨О╪▄Д╦╨И║╨Е╨■Е╦┌Е°╨Е▐▒Е╠∙И°─Ф╠┌О╪▄Ф┬▒Д╩╛Г╬▌Е╙⌡Ф≈╤Е╟ Г▌╟Ф▀⌡Ф■╤Г╬▌Г■╡Е╜╕Е▒≤Ц─┌<br />\r\nФ°╛Д╨╨ГЁ╩Ф╜ёХ╖└Д╦⌠Д╦ Г╬▌Г■╡Е╜╕Ф═║Ф╞∙Д╦ И╚≤Г╨╖Г╬▌Г■╡Е╦┬О╪▄Ф▄│Ф°┴Б─°Д╦╜Е⌡╫Е┼ЁЕ┼╗Е╠─Х╝╓Х╞│И╚≤Г╨╖Г╬▌Г■╡Е╦┬Х╞│Д╧╕Б─²О╪▄Г╩▐И╙▄Д╦╟Е╞▄О╪▄Г▌╟Е╞╧Е╓√И∙©Ф°÷Ф▀⌡Ф■╤Г╬▌Г■╡Е╜╕Е▒≤О╪▄Д╪═Ф▌┬Ф°─Ф√╟Д╦⌠Д╦ Г╬▌Г■╡Ф┼─Ф°╞О╪▄Г°÷Ф╜ёЕ╝·Г■╗Г └Г╬▌Г■╡Ф┼─Ф°╞Ц─┌Д╦─Е╞╧Д╦─Х╬┘Е╞╪О╪▄Е╝·Х╥╣Д╦╜Е╜╕Д╧═О╪▄И ▐Е┬╟И ▐Е╜╕О╪▄Е▄┘Е╜╕Д╪ Д╦╨Ф╜╒О╪▄Е╜╕Д╪ Е░▌Ф▌╗Х█░Е╟╠Д╦ О╪│Х╬┘Е╞╪Е╪─Д╦ О╪▄Е┘█Х╢╧Ф▐░Д╬⌡1Е╧╢Ф┼─Ф°╞Ф■╞Ф▄│Ц─┌Е╜╕Е╬▓Ф°÷Е░▌Е▐╞Г∙≥Е╨≈Е╝·Д╧═Е╥╔Д╫°О╪▄Е╬┘И│┤Д╪≤Е▌ О╪│<br />\r\nЕ┬²Г╨╖Г╬▌Г■╡Е÷╧Х╝╜О╪ 500Е┘┐<br />\r\nГ╬▌Г■╡Ф╕┌Х╝╨Ц─│Ф╤┬Ф╞▓Ф²─Х▐▄Ц─│Ф┴▀Е·▀Д╦▌Г■╡Е·▀Г └И─┴Ф▀╘О╪▄Д©╝Г■╡О╪▄Ф▄┤Г■╡Ф╡╧Г └Д╫©Г■╗Е▓▄Ф▄┤Г■╡Ф╡╧Д╦▌Х┌╓Х┴╡Г └И─┴Ф▀╘О╪▄Ф═┤Е┤├Ф┴▀Х╤ЁИ┐╗Ф┼╓Г░├О╪▄Х╢╢Г┴┤Г■╡Е┬╤Д╫°Ц─│Е÷╨Г║─Е╫╘Г╩≤Е°╗Ф▄┤Г■╡Д╦┼Г └Ф▌▓Е┬≈Е▐┼Ф░╜И┘█Г╜┴Ц─┌Ц─┌Ц─┌<br />\r\nЕ╫╘Г╩≤Г╠╩О╪ <br />\r\nО╪┬Д╦─О╪┴Ф┴▀И┐╗Е╫╘Г╩≤Е┬╤Д╫°О╪ <br />\r\n1Ц─│Х┴╡Е╫╘Г └Д╨├Х╖ёЕ▐┼Ф▌▄Ф▐║&nbsp;2Ц─│Ф╦░Е▐≤Х┴╡Г └Е┬╤Д╫°Е▐┼Х©░Г■╗<br />\r\n3Ц─│Г┌╧Ц─│Г╨©Ц─│И²╒Г └Г╩┐Д╧═&nbsp;<br />\r\n4Ц─│Е⌡╬Ф║┬Г └Г╩┐Д╧═О╪┬Е°├Ц─│Е╟√Д╨■Г⌠ёХ┼╠О╪▄Е©┐Е╫╒Х┼╠О╪▄Х┴╡Е²≈О╪▄Х╠╧Г╨╧О╪▄Ф√▒И╘╛Г╨╧О╪▄Е╟▐Г▌╚Г▒╟О╪▄Е╓╖Г▌╚Г▒╟Х┼╠О╪▄Ф╗╠Ф║┐О╪▄Ф╗╠Х┼╠О╪▄.....О╪┴<br />\r\n5Ц─│Е⌡╬Ф║┬Г └Д╫█Г╫╝Г╩┐Д╧═&nbsp;6Ц─│И╔╟Е⌠│Г └Х©░Г■╗Е▓▄Г╡≤Х╢╢<br />\r\n7Ц─│Е▀╬Г╩≤Г╩┐Д╧═&nbsp;8Ц─│Ф▀⌠Е█╟Х┼╠Е·▀Г╩┐Д╧═<br />\r\n9Ц─│Г■╩ФЁ∙Е╪▐&nbsp;10Ц─│Г■╡Ф╡╧Г └Д╫©Г■╗Ф√╧ФЁ∙<br />\r\n<br />\r\nД╦╜Г╨╖Г╬▌Г■╡Е÷╧Х╝╜О╪ 1500Е┘┐<br />\r\nИ≥╓Д╩╔Д╦┼Е┬²Г╨╖Х╞╬Г╗▀О╪▄Д╦╜Г╨╖Е╫╘Г╩≤Ц─│Ф┴▀Х╤ЁИ┐╗И─▐Ф≤▌Ф╟╢Ф≥╤Г■╡О╪▄Д╦╜Г╨╖Е╫╘Г╩≤О╪▄Е░└Е╪▐Е┘┴Г√≈О╪ <br />\r\nО╪┬Г╬╫Ф╞⌡О╪▄И⌡╙Х┼╠О╪▄Х²╢Х²╤Г╩⌠О╪▄Х²╢Х²╤О╪▄Х█┴Х▌⌠О╪▄Д╦┐Ф≤÷Г⌠╒Х≥╚О╪▄Ф╣╥Х╠ О╪▄И┤▒И╠╪О╪▄Г©═Е└©О╪▄Ф╓╟Ф═▒О╪▄Е⌠┬Е√╫KITTYО╪▄Д╦╜Е⌡╫Е╗┐Е╗┐О╪│Е░└Г╠╩Е█║И─ .......О╪┴О╪▄Ф°─Ф√╟Ф≈╔И÷╘Е°├Г╛■Е╫╘Г╩≤О╪▄Д╦╜Е⌡╫Ф╟▒И≈╢Е╫╘Г╩≤....Е┘┴Г√≈Г╠╩О╪ <br />\r\nО╪┬Д╦─О╪┴Ф┴▀И┐╗Е┘┴Г√≈Г■╡Е┬╤Д╫°О╪ <br />\r\n1Ц─│Х┤╙Г└╤Г■╡Е┘┴Г√≈Е┼═Е⌡╨Е┬╤Д╫°&nbsp;2Ц─│Е█┼Х╢╢Г┴┤Е┘┴Г√≈Г■╡Е┬╤Д╫°<br />\r\n3Ц─│Ф╣┘Х╢╢Г┴┤Г■╡Е┬╤Д╫°&nbsp;4Ц─│Е█∙Х┴╡Е┘┴Г√≈Г■╡Е┬╤Д╫°<br />\r\n5Ц─│Е╫╘Х┴╡Е┘┴Г√≈Г■╡Е┬╤Д╫°&nbsp;6Ц─│ФЁ∙Е╪▐Е┘┴Г√≈Г■╡Е┬╤Д╫°<br />\r\n7Ц─│И∙╜Е╟└Е┘┴Г√≈Г■╡Е┬╤Д╫°&nbsp;8Ц─│Е╫╘Х┴╡Ф╦░Е▐≤Е┘┴Г√≈Г■╡Е┬╤Д╫°<br />\r\nО╪┬Д╨▄О╪┴Х╤ЁИ┐╗Е┘┴Г√≈Г■╡Е┬╤Д╫°О╪ <br />\r\n1Ц─│Х┤╙Г└╤Г■╡Е┘┴Г√≈Е┼═Е⌡╨Е┬╤Д╫°&nbsp;2Ц─│Е█∙Х┴╡Е┘┴Г√≈Г■╡Е┬╤Д╫°<br />\r\n3Ц─│Е╫╘Х┴╡Е┘┴Г√≈Г■╡Е┬╤Д╫°&nbsp;4Ц─│ФЁ∙Е╪▐Е┘┴Г√≈Г■╡Е┬╤Д╫°<br />\r\nД╦┴Ц─│Е█╦И≥╓О╪ <br />\r\nО╪┬Д╦─О╪┴Ф┴▀И┐╗Ф▄┤Г■╡Е█╦И≥╓О╪ <br />\r\n1Ц─│Х╢╢Г┴┤Ф▄┤Г■╡Е█╦И≥╓&nbsp;2Ц─│Ф╟╢Ф≥╤Г■╡Е█╦И≥╓<br />\r\n3Ц─│Е┘┴Г√≈Г■╡Е█╦И≥╓&nbsp;4Ц─│Г■╡Ф╡╧Е█╦И≥╓<br />\r\n4Ц─│И╔╟Е⌠│Е█╦И≥╓<br />\r\nО╪┬Д╨▄О╪┴Х╤ЁИ┐╗Ф▄┤Г■╡Е█╦И≥╓О╪ <br />\r\n1Ц─│Х╢╢Г┴┤Ф▄┤Г■╡Е█╦И≥╓&nbsp;2Ц─│Ф╟╢Ф≥╤Г■╡Е█╦И≥╓<br />\r\n3Ц─│Е┘┴Г√≈Г■╡Е█╦И≥╓&nbsp;4Ц─│Г■╡Ф╡╧Е█╦И≥╓<br />\r\n4Ц─│И╔╟Е⌠│Е█╦И≥╓<br />\r\nЕ⌡⌡Ц─│Ф╟╢Ф≥╤Г■╡Ц─│И⌡∙Х┼╠<br />\r\nО╪┬Д╦─)Ф╟╢Ф≥╤Г■╡Е┬╤Д╫°<br />\r\n(Д╨▄О╪┴Ф╟╢Ф≥╤И⌡∙Х┼╠<br />\r\nО╪┬Д╦┴)Ф╟╢Ф≥╤Г■╡Г └Е█╦И≥╓<br />\r\n<br />\r\nИ╚≤Г╨╖Е┘╗Х┐╫Х╞╬Г╗▀Д╪═Ф▌┬О╪ О╪┬Е╜╕Х╢╧2600О╪┴И≥╓Д╩╔Д╦┼Х╞╬Г╗▀О╪▄И╚≤Г╨╖Х╞╬Г╗▀Х©≤Е╟├Д╪═Ф▌┬<br />\r\nФ°─Ф√╟Г └Х┼╠Е╪▐Ф╟╢Ф≥╤Ф▄┤Г■╡Ф°┴ABФ∙┬Ф·°Ф╟╢Ф≥╤Г■╡Ц─│Г╪╓Г╨╥Е├┘И⌡∙Г■╡Ц─│Е├╟Х┼╠Г░┴Г▓┐Г■╡Ц─│И≥╤Г⌠╥Ф╟╢Ф≥╤Г■╡Г └Е┬╤Д╫°Ц─│Х┼╠Е╪▐Е┘┴Г√≈Ф▄┤Г■╡Г └Е┬╤Д╫°Ц─│Ф╟╢Ф≥╤Г■╡Е▓▄Е┘┴Г√≈Г └Е█╦И≥╓Ц─│Х╤ЁИ┐╗Ф╟╢Ф≥╤Г■╡Е▓▄Е┘┴Г√≈О╪┬Х╢╢Г┴┤Ц─│ФЁ∙Е╪▐Х╢╢Г┴┤О╪┴Г■╡Г └Е┬╤Д╫°Ц─│И─▐Ф≤▌И≈╙Г╡┴Е╩╤И∙©Е┘┴Г√≈Г └Е┬╤Д╫°Ц─│ФЁ∙Е╪▐Е┘┴Г√≈Г■╡Г └Е┬╤Д╫°Ц─│Е╫╘Х┐╤Е┘┴Г√≈Г■╡Ц─│Е█∙Х┴╡Х©┤Ф╦║Ц─│Е▐▄Х┴╡Х©┤Ф╦║Ц─│Е┘┴Г√≈И⌡∙Х┼╠Ц─│Е┘┴Г√≈И∙╜Е╟└Г╡┴Г■╡Е┬╤Д╫°Ц─│Е┘┴Г√≈Х╢²ЕёЁГ■╡Ц─│Е┘┴Г√≈Е╧╡Х┼╠Г■╡Ц─│Х╤ЁИ┐╗Е┘┴Г√≈Г■╡Ц─│Х╢╢Г┴┤Е┘┴Г√≈Ц─│Е█∙Х┴╡Е╩╤И∙©Ц─│И≈╙Е┘┴Ц─│Ф╦░Е▐≤Г■╡Г └Е┬╤Д╫°.', '', '0', '1267450922', '1269018634', '', 'Г╗▀Е╟▐Е╖░', '13987645353', '', '127.0.0.1', '23', '1');
INSERT INTO `f_info` VALUES ('38', '3', '409', 'Е╘ Г╨╠Г╓╪Ф°█Е┤╨Г╖÷Ц─│Е╝ Е│ ', 'Ц──Ц──Ф°╛Е╨≈Д╦⌠Д╦ Ф▐░Д╬⌡Е╘ Г╨╠Ц─│Г╓╪Ф°█Ц─│Ф∙╛И┘▓Ф°█Е┤╨Г╖÷О╪▄И┤▐Х╨╚Е╝ Е│ О╪▄Ф²╔Ф═╥Е╝ Е│ Ц─┌Д╩╥Ф═╪Е┘╛И│⌠О╪▄Ф╛╬Е╪▐Ф√╟И╒√Ц─┌Е╨├Е╪─Д╦ О╪▄Д╪≤Ф┐═Е╓ Е╓ Ц─┌Ф╛╒Х©▌Е░└Д╫█Е┤├Ф√╟Е╗≤Ф²╔Ф°╛Е╨≈Х╞∙Г╘©О╪│<br />\r\n<br />\r\nЦ──Ц──Д╦╩Х╕│Ф°█Е┼║И║╧Г⌡╝О╪ Ф┴╧Е▐▒Ц─│И⌡╤Е■╝Ц─│Е┤╨Г╖÷Ц─│И┤▐Х╨╚Е╝ Е│ Е╘ Г╨╠Ц─│Г╓╪Ф°█Ц─│Ф∙╛И┘▓Ф°█Ц─┌Е┤╨Е■╝Е╘ И·▀Ц─│Е╓╢Г╨╠Ц─│Ф┴▀Е╔≈Ц─│Ф┼╚Х┌╘Ц─│Хё≥Ф▓▒Ц─┌Д╦⌠Д╦ Ф√╟Е╗≤Е▄√Е╕├О╪▄Х╥÷Е╕├О╪▄Д╦╙Ф─╖Е╘ Е╨├О╪▄Е▐╦Д╩╙Ф▒└Е┐▐Ц─┌Ф┴©Ф▌╔Е┘╛Е▐╦Е⌡╒Д╫⌠Е╧╢Д╪ Е╕├Ц─┌Д╦⌠Д╦ Ф√╟Е╗≤Е▄√Е╕├Е╦┬Е÷╧Х╝╜Ц─│Д╦╙Д╨╨Е╫╘Е╕├Е÷╧Х╝╜Ц─┌<br />\r\n<br />\r\nЦ──Ц──Е╝▄Г╬▌Ф√╟Е╗≤О╪▄Д╫═Ф°─И≈╙Д╨╝О╪│', '', '0', '1267863863', '1267863863', '', 'Г╗▀Е╟▐Е╖░', '13576039972', '120885811', '127.0.0.1', '24', '1');
