INSERT INTO `f_info` VALUES ('40', '3', '63', 'Е╫╘Х┴╡Е░█Г┴┤3Е┘┐/Г⌡▓ И─│Х╢╖Д╦┼И≈╗ Х╞ Д©║Ф°█Е┼║', 'Е█≈Ф≤▄Ф√╟И⌡┘Е╫╘Е█╟Е▌┌Е█╟Е┬╥Е╫╘Х┴╡Е░█Г┴┤&nbsp;10Г⌡▓Е░▄Г┴┬3Е┘┐/Г⌡▓&nbsp;5Г⌡▓Е░▄Г┴┬3.8Е┘┐/Г⌡▓О╪▄2Г⌡▓Е░▄Г┴┬7.5Е┘┐/Г⌡▓О╪┬300gГ └Е▐▄И²╒И⌠°Г┴┬Г╨╦)&nbsp;<br />\r\n<br />\r\nЕ▐╕Е█╟Ф≈═Г╒ЁХ│■Е█∙Ц─│Е╝ёД╪═Е╫╘И║╣Ц─│Д╩ёИ┤▒Е┬╦Ц─│DMЕ█∙Ц─│Д╦█Е╧╡Х┐╤Ц─│Ф°█Хё┘Е░┼Г┴▄Ц─│PVCЕ█║Ц─│Д©║Г╨╦Д©║Е╟│Г╜┴Г╜┴Ц─┌<br />\r\nЕ▐╞Д╦┼И≈╗Ф°█Е┼║Ф╢╫Х╟┬Ц─│Ф▌╔Г╗©О╪▄Е█≈Ф≤▄Е╦┌Е├┘Е▐╞И─│Х╢╖Д╦┼И≈╗О╪▄Х╤┘Е©╚И─÷О╪▄И╚≤Х╢╗И┤▐О╪▄Х╝╡Х╞ Д©║О╪│Г╚╜Х╞ Д╦╨Ф┌╗Ф°█Е┼║О╪│И┤▐Е╓╖Д╪≤Ф┐═О╪▄Д╨╓Х╢╖Е▐┼Ф≈╤О╪▄Х╢╗И┤▐Ф°┴Д©²Х╞│О╪│<br />\r\n<br />\r\nЕ░█Г┴┤Х┤╙Х║▄Х╝╬Х╝║Ц─│Ф√┤Е╜≈Е▓▄Е⌡╬Г┴┤Х┤╙Д╦╩Е╓┤Е╔╫О╪▄Ф▌╗Х█░CorelDRAW&nbsp;8.0Г┴┬Ф°╛Ц─┌Х┤╙Х║▄Х╝╬Х╝║Х─┘О╪▄Д©²Х╞│Е├┘Е╝╧Е┤├Г║╝Ф─╖О╪▄Ф┬▒Е╓└Д╦█Х╢÷Х╢ёФ═╦Е╞╧Е├┘Е╝╧Г └Е┤├Г║╝Ф─╖Ц─┌<br />\r\nЕ╓┤&nbsp;ФЁ╗О╪ Ф┴─Ф°┴Е╫╘Х┴╡Е░█Г┴┤Е█╟Е┬╥Е╠·Д╨▌Ф▀╪Г┴┬Е█╟Е┬╤О╪▄И╒°Х┴╡Д╦▌Г■╣Х└▒Ф≤╬Г╓╨И╒°Х┴╡Ф°┴5%-10%Х┴╡Е╥╝Е╠·Ф╜ёЕ╦╦Г▌╟Х╠║О╪▄Е╕┌Е┤╨Г▌╟Ф╜╓И≈╝И╒≤Ф╕┌Д╦█И──Х╢╖О╪│', '', '0', '1267450922', '1265382992', '', '', '13576039972', '120885811', '127.0.0.1', '17', '1');
INSERT INTO `f_info` VALUES ('41', '3', '168', 'Е┘█Х╢╧Ф≈═Г╨©Д╦┼Г╫▒Е█║О╪▄Е┘█Х╢╧Д╦┼Г╫▒', 'Х╞╥Д╦╙Е┬╚Е∙├Е╝╤Д╦█Х╕│Х╞▀Ф╞│Е┬╚Д╨╨Г └Д╨╖Е⌠│,Ф▐░И╚≤Х┤╙Е╥╡Г └Д╨╖Е⌠│,Д╩─Д╧┬Д╦▀Х╫╫240KBФ┤┌Г■╣Х└▒Г └Д╨╨И┐╫Г÷╔И│⌠Д╦▀Х╫╫И─÷Е╨╕Х╥÷Е╦╕Е╝╫Ф°┴Е┘Ё!!!<br />\r\nХ╥÷ADSLФ°┴Е┘Ё,&nbsp;Е▐▀Ф┐┘Ф▐░И├▓,ФЁ╗Ф└▐Е│┤Х╢╖<br />\r\n<br />\r\nЕ┤╨Е■╝Ф≈═Г╨©Д╦┼Г╫▒Е█║Е█║Г ┤О╪▄Е█║Г ┤Г╩┬Ф·│Г┴┬Е╦╕Е╠▐Х■╫Г╫╘О╪▄И≤╡Г■╣Гё│Е╧╡Ф┴╟О╪▄Е╦╕Е╓╘Г╨©Г └Ф≈═Г╨©Г╫▒Е█║О╪▄Е┼÷Г▌┤Ф⌡╢Е╪╨О╪▄Х╥²Г╕╩Ф⌡╢Х©°,Е╝≤Ф√╧Г╩≥Е┤╨Г └Ф∙╟Ф█╝<br />\r\nЕ▐╞Х╖├Х▄┐Е⌡╢Е▐╞Х╬╬3000Г╠Ё,Г╘©Е╒≥Г └Х╞²Д©║Е▐╥Ф┴⌠Ф┼≤,Ф╞■Х┤╙Е╦╕Г └Г╫▒Е█║Е╪╨О╪▄Е╝╒Ф┬╥ФЁ╗Ф└▐О╪▄<br />\r\nФ°╛Ф╛╬Ф≈═Г╨©Д╦╩Х┼╞Г┴┤Д╦╨8187L,Е╧╤И┤┤Г■╗Д╨├И╚≤Е┼÷Г▌┤WIFIФ╗║Е²≈О╪▄SMAФ▌╔Е▐ёЕ▐╞Ф▀├Ф█╒Е╓╘Г╨©О╪▄Е▐╙Х╕│Д╫═<br />\r\nФ┴─Е°╗Е°╟Е▄╨Ф°┴Г┐╜Г┌╧,Е╟╠Х┐╫Х╝╘Д╫═Е┘█Х╢╧Д╦┼Г╫▒,О╪▄О╪▄Е╕┌Ф·°Д╫═Ф┴─Е°╗Г └Е°╟Е▄╨Ф╞■Х╬┐Е│▐О╪▄О╪▄Ф┐ЁФ▌╔Ф■╤Ф⌡╢Х©°Г └<br />\r\nД©║Е▐╥О╪▄Е▐╞Д╩╔И─┴И┘█И╚≤Е╒·Г⌡┼И⌡╥Х╬╬Е╝ Е░▒Е╓╘Г╨©О╪▄Ф∙┬Ф·°Е╔╫Д╦█Е╔╫,Е╓╘Г╨©Ф²╔Х╞╢Х╞²,Д╦█Ф╒╜ФЁ║,Е╓╘Г╨©Е⌡╬Ф≤╞Г╛╛2Е╪═О╪▄&nbsp;Ф┬▒Ф°╛Д╨╨Е°╗Е█≈Ф≤▄Е╦┌Е▄╨Хё┘Д╨├<br />\r\nNЕ╔≈,Ф╛╒Х©▌Е▓╗Х╞╒Д╦█Ф╦┘Ф╔ Е°╟Ф√╧Х╞╥Г■╣Х╞²Е▓╗Х╞╒&nbsp;Е╧╢Е╨∙Ф╦┘Х╢╖О╪▄Г┴╧Д╩╥И■─Е■╝О╪▄Ф╜ёЕ⌠│Е█║Г ┤', '', '0', '1270893044', '1270893044', '', 'Е╟▐Г▄╚', '13987645353', '', '127.0.0.1', '46', '1');
INSERT INTO `f_info` VALUES ('42', '3', '652', 'Е┤╨Х╝╘Е░└Г╖█Е╓╖Е╟▐Ф▌▓И┤▐Х╥▒Х╫╕Е▐┼Е╟▐Г╬┼Д╫▌Д╩╥Е⌡╫Д╨╖Х╦▐Ф²©Х╫╕', 'Е░└Г╖█Ф╛╬Е╪▐Х©⌡Е▐ёФ°╛Г■╟2Ф┴▀DIO50б═И⌠┐Ф°╗AG100б═1500Е╥╕Е▐ЁД╦─Х╬├О╪│05Х⌡▀Х⌡▀О╪│Ф╩▒Ф²©Х╫╕О╪│Е╟▐Х╤┼И┤▌О╪│Е╓╖Е╟▐Ф▌▓И┤▐Е┘╛Х╣⌡О╪│yamahaФ╣╥Х╠ 250б═Г╨╞Ф╟╢Е╥²Е╢▌250б═И⌡┘Г▌⌡Е⌠┬б═И⌠┐Ф°╗AGБ─■100CCб═Х║≈Х╫╕Г▌▀О╪ Г⌡≈Е▄╙б═74Aб═75AБ─■250б═77A400О╪┬+VCО╪┴б═CBRб═19б═CBRб═22б═97Е╧╢Е╥²Е╢▌ZZR250б═ZXR250б═ZXR400Vб═Ф°╛Г■╟VFRб═400б═И≤©Ф≥╝Е┬╘Д╨ RS50О╪┬Е╟▐Х╥▒Ф╛╬Е▓▄Е╓╙Е╜░Ф╛╬О╪┴Ц─┌Е╕┌Х╕│Г°▀Е⌡╬Г┴┤Х╞╥Е°╗Ф┬▒QQГ╘╨И≈╢Г°▀Г▌╟Х╫╕О╪▄QQО╪ б═Е▓╗Х╞╒Г■╣Х╞²О╪ б═Д╦°Е█┤Е┬ Е╜░.QQ<br />\r\nЦ─┌И²▓Е╠╠Х╥╞Г≥╬Х╢╖Е╓╖Ф╔╪Ф√°Е╞╧И²╒Ц─┌<br />\r\nЕ▐╕<br />\r\nФ┴©Ф▌╔Г°│Е├┘Е╓√Е░└Г╠╩Е╓╖Е╟▐Ф▌▓И┤▐Х╥▒Х╫╕О╪▄Ф■╧Хё┘О╪▄Г╩╢Д©╝О╪▄Г╬▌Е╝╧О╪▄Г╜┴Д╦ Е┼║Ц─┌Е╓╖И┤▐Е┤╨Е■╝Е░└Г╠╩Е⌠│Г┴▄Х╫╕Е▐▒Е┼╗Ф°╨Е▐┼Г⌡╦Е┘ЁИ┘█Д╩╤', '', '0', '1270893073', '1459617888', '', 'Е┬ Е╜░', '15006570637', '120885813', '127.0.0.55', '422', '3');
INSERT INTO `f_info` VALUES ('43', '4', '166', 'И┘╥Г²©T5550Е▐▄Ф═╦Х┤╙Е╦╕Ф▒└Е┐▐Е╓╢Г╛■Х╝╟Ф°╛Е┤╨Е■╝', 'Ф╦┘Е█▌Е░▄Ф√╧И■▀И■░&nbsp;K411<br />\r\nЕ╠▐Е╧∙Е╟╨Е╞╦&nbsp;14.1Х▀╠Е╞╦&nbsp;<br />\r\nЕ╠▐Е╧∙Е┬├Х╬╗Г▌┤&nbsp;1280ц≈800&nbsp;<br />\r\nХ┐▄Е┘┴Ф┼─Ф°╞&nbsp;TFT&nbsp;WXGA&nbsp;<br />\r\nЕ╓└Г░├Е≥╗Е·▀Е▐╥&nbsp;И┘╥Г²©2Е▐▄Ф═╦&nbsp;T5550&nbsp;1.83GHz&nbsp;2Г╨╖Г╪⌠Е╜≤2m<br />\r\nЕ├┘Е╜≤&nbsp;1G<br />\r\nГ║╛Г⌡≤Е╝╧И┤▐&nbsp;120GB&nbsp;SATA&nbsp;5400Х╫╛<br />\r\nФ≤╬Е█║Х┼╞Г┴┤&nbsp;SIS307&nbsp;256M<br />\r\n4Д╦╙USB&nbsp;4Е░┬Д╦─Х╞╩Е█║Е≥╗<br />\r\nХ┤╙Е╦╕Ф▒└Е┐▐Е╓╢<br />\r\nЕ┘┴И╘╠DVD<br />\r\n<br />\r\nЕ▌÷Хё┘Е▄┘&nbsp;Е┘┘Г■╣Е≥╗&nbsp;Х╞╢Ф≤▌Д╧╕&nbsp;Д©²Д©╝Е█║&nbsp;Е▐▒Г╔╗&nbsp;Ф╜╓Ф°╨Ф≤╞3Е╧╢Е┘╗Е⌡╫Д©²Д©╝&nbsp;Х©≤Ф°┴Е╟├Х©▒1Е╧╢Г └Д©²Д©╝<br />\r\n<br />\r\nЕ╓√Х╖┌9Ф┬░Ф√╟&nbsp;Ф°╛Ф²╔Е╟╠Ф≤╞И╩▒Х┴╡Г └&nbsp;Ф╡║Д╩╩Д╫∙Гё╗Ф█÷&nbsp;Ф┴─Д╩╔Г°▀Д╦█Е┤╨Ф≈╖<br />\r\n<br />\r\nЕ┼·Е┘╛Ф╡║Д╩╩Д╫∙И≈╝И╒≤О╪▄CPUЕ╬┬Е╪╨Г └О╪▄Ф╞■Г╫▒Д╦┼Г └И┐╫Е╔╫Ц─┌Е┼·Е┘╛Г┌▓Х┌║Ф╦╦Ф┬▐И┐╫Е▐╞Д╩╔', '/uploads/201304/5_127091145314158_100X75.jpg', '2', '1270911521', '1270911521', '', '', '3711234', '', '127.0.0.1', '3', '1');
INSERT INTO `f_info` VALUES ('44', '4', '166', '9Ф√╟И╚≤И┘█Г╛■Х╝╟Ф°╛Е┤╨Е■╝', 'Е÷╨Ф°╛И┘█Г╫╝<br />\r\n<br />\r\nЕ╓└Г░├Е≥╗&nbsp;Х©┘И╘╟2Д╩ё&nbsp;1.6GHz&nbsp;<br />\r\nД╨▄Г╨╖Г╪⌠Е╜≤:&nbsp;2M<br />\r\nЕ├┘Е╜≤&nbsp;768MО╪▄(Е▐╞Е█┤Г╨╖)Ц─┌<br />\r\nГ║╛Г⌡≤&nbsp;40G&nbsp;(Е▐╞Е█┤Г╨╖)Ц─┌<br />\r\nФ≤╬Е█║О╪ 64MЦ─┌<br />\r\n4Д╦╙USBФ▌╔Е▐ёЦ─┌<br />\r\nЕ├┘Г╫╝Е┘┴И╘╠<br />\r\nФ≤╬Г╓╨Е╠▐&nbsp;15.1&nbsp;Х▀╠Е╞╦О╪┬Е╝╫Е╠▐О╪┴&nbsp;<br />\r\nХ┐╫Д╦┼Г╫▒Ц─│Г°▀Г■╣Е╫╠Ц─│Х┌║Г╔╗Ц─│Е╟▐Х╞╢Г╜┴Г╜┴Ц─┌<br />\r\nГ▌╘Г╘©Х╤┼Г│╚Г╨©Г╜┴3DФ╦╦Ф┬▐Ф╡║Ф°┴И≈╝И╒≤О╪▄Е╬┬Ф╣│Г∙┘Ц─┌<br />\r\nФ≤╞Г▌╘Ф╦╦Ф┬▐Ц─│Г°▀Г■╣Е╫╠Г └Е╔╫И─┴Ф▀╘Ц─┌Ф°┴Х╞ Ф└▐Г └Ф²╔Г°▀Г°▀О╪▄Е▐╞Е╫⌠Е°╨Х╞∙Ф°╨Ц─┌<br />\r\nГ°▀Ф°╨Е▐╞Ф┴⌠Г■╣Х╞².', '/uploads/201304/5_12709120484480_100X75.jpg', '1', '1270912091', '1270912091', '', 'Г▌▀Е░▄Е╜╕', '15006570664', '', '127.0.0.1', '63', '1');
INSERT INTO `f_info` VALUES ('45', '4', '168', 'Г■╣Х└▒Е÷▌ Х╧╜Г╫▒Е█║ Е░└Г╖█Е⌠│Г┴▄Г╛■Х╝╟Ф°╛Е┘╗Е╦┌Ф°─Д╫▌Д╩╥', 'Ф°╛Е┘╛Е▐╦Д╦╨Д╨├Е⌡·Ф┼╔Е╧©Е╓╖Ф√╟Х─│Е╝╒Ф┬╥Г └Е▌ Г┬╠Е▓▄Ф■╞Ф▄│О╪▄Х╝╘Е╧©Е╓╖И║╬Е╝╒Х┐╫Д╧╟Е┬╟Е╝·Ф┐═Х─▄Е▐┬Е╝·Г■╗Г └Г■╣Х└▒О╪⌡Г┴╧Е┬╚Ф▌╗Е┤╨Д╩╔Д╦▀Ф°╨Е·▀О╪⌡<br />\r\n<br />\r\nЕ╝·Г■╗Е·▀<br />\r\nCPUО╪ AMD&nbsp;240<br />\r\nД╦╩Ф²©О╪ Е█▌Г║∙<br />\r\nГ║╛Г⌡≤О╪ 320G<br />\r\nЕ┘┴И╘╠О╪ Е█▌Г║∙DVD<br />\r\nЕ├┘Е╜≤О╪ 2g<br />\r\nФ≤╬Г╓╨Е≥╗О╪ 19Ф╤╡Ф≥╤<br />\r\nФ°╨Г╝╠Г■╣Ф╨░О╪ 350WЕ╓╖Иё▌Ф┴┤<br />\r\nИ■╝Г⌡≤И╪═Ф═┤О╪ И≤╡Ф╟╢Е╔≈Хё┘&nbsp;<br />\r\nЕ▐┌Х─┐Д╩╥И▓╠О╪ 2099<br />\r\n<br />\r\nЕ╝╤Г■╗Е·▀<br />\r\nCPUО╪ И┘╥Г²©e5300Е▐▄Ф═╦<br />\r\nД╦╩Ф²©О╪ Е█▌Г║∙<br />\r\nГ║╛Г⌡≤О╪ 320G<br />\r\nЕ├┘Е╜≤О╪ 2G<br />\r\nЕ┘┴И╘╠О╪ Е█▌Г║∙DVD<br />\r\nФ≤╬Г╓╨Е≥╗О╪ 19Е╞╦И╚≤Ф╦┘<br />\r\nФ°╨Г╝╠Г■╣Ф╨░О╪⌡350WИ²≥Г■╣Г▌▀<br />\r\nИ■╝Г⌡≤И╪═Ф═┤О╪ Е▐▄Иё·Г┤∙Е╔≈Хё┘<br />\r\nЕ▐┌Х─┐Д╩╥И▓╠О╪ 2399<br />\r\n<br />\r\nФ╦╦Ф┬▐Е·▀<br />\r\nCPUО╪ AMD&nbsp;8650Д╦┴Ф═╦<br />\r\nД╦╩Ф²©О╪ Е█▌Г║∙m4a78<br />\r\nЕ┘┴И╘╠О╪ Е█▌Г║∙DVD<br />\r\nГ║╛Г⌡≤О╪ 500G<br />\r\nЕ├┘Е╜≤О╪ 2G<br />\r\nФ≤╬Г╓╨Е≥╗О╪ 19Е╞╦И╚≤Ф╦┘Ф╤╡Ф≤╬<br />\r\nФ≤╬Е█║О╪⌡Д╦┐Е╫╘Х≥╧9600GTИ╩└И┤▒Ф²©<br />\r\nФ°╨Г╝╠Г■╣Ф╨░О╪ 350WИ²≥И÷ЁГ▌▀<br />\r\nИ■╝Г⌡≤И╪═Ф═┤О╪ Е▐▄Иё·Г┤∙Е╔≈Хё┘<br />\r\nЕ▐┌Х─┐Д╩╥И▓╠О╪ 2699<br />\r\n<br />\r\nИ╚≤И┘█Е·▀<br />\r\nCPUО╪ AMD&nbsp;8650Д╦┴Ф═╦<br />\r\nД╦╩Ф²©О╪⌡Е█▌Г║∙<br />\r\nЕ┘┴И╘╠О╪ Е█▌Г║∙DVD<br />\r\nГ║╛Г⌡≤О╪ 500G<br />\r\nЕ├┘Е╜≤О╪⌡4G<br />\r\nФ≤╬Г╓╨Е≥╗О╪ 22Е╞╦И╚≤Ф╦┘<br />\r\nФ≤╬Е█║О╪⌡Д╦┐Е╫╘Х≥╧9600GTИ╩└И┤▒Г┴┬<br />\r\nФ°╨Г╝╠Г■╣Ф╨░О╪ И∙©Е÷▌<br />\r\nИ■╝Г⌡≤И╪═Ф═┤О╪⌡Е▐▄Иё·Г┤∙И≤╡Ф╟╢Е╔≈Хё┘<br />\r\nЕ▐┌Х─┐Д╩╥И▓╠О╪ 3899<br />\r\nЕ▐╕Е╓√Ф°┴Е█▌Г║∙&nbsp;Ф┐═Ф≥╝&nbsp;Х│■Ф┐Ё&nbsp;Г╜┴Д╪≤Е┼©Д╩╥Ф═╪Г╛■Х╝╟Ф°╛Ц─┌Ф°┴И°─Х╕│Е▐╞Д╩╔Х│■ГЁ╩<br />\r\nД╩╔Д╦┼Д╨╖Е⌠│Г║╛Д╩╤Е²┤Д©²Д©╝Д╦┴Е╧╢О╪▄Д╦┴Д╦╙Ф°┬Е├┘Е┘█Х╢╧Д╦┼И≈╗Ф┼─Ф°╞Ф°█Е┼║О╪▄О╪│<br />\r\nХ║▄Ф┐┘Е╓ Е▐≤О╪│Д╩╔Д╦┼Д╩╥И▓╠Е▐╙Д╫°Е▐┌Х─┐Д╩╥О╪▄Е┘╥Д╫⌠Д╩╥И▓╠Д╩╔Е╫⌠Е╓╘Х╢╜Д╧╟Д╦╨Е┤├О╪│<br />\r\nЕ╦┌Е▄╨Е▐╞Д╩╔Х─┐Х≥▒И─│Х╢╖Д╦┼И≈╗Е╝┴Хё┘<br />\r\nЕ▐╕Ф°┴И■─Е■╝Ф≈═Г╨©Х╧╜Г╫▒Е█║Ц─┌Д╩╥Ф═╪Ф°┴Д╪≤Е┼©<br />\r\nЕ╨■Ф°╛Е╨≈Е▐▒Е╠∙Ф─╔И°─Е°╗Ф═║Д╦ Е┼║Е▒≤О╪▄Е╥╔Х╣└И²╒Д╩╙Ц─┌&nbsp;Г║╛Д╩╤Ф⌡╢Ф█╒Е▐╕Х╝╝Ц─┌<br />\r\nЕ°╟Е²─О╪ Е█≈Ф≤▄Е╦┌Д╦°Ф√╧Г■╣Х└▒Е÷▌', '', '0', '1270912479', '1270912479', '', 'Ф²▌Е┘┬Г■÷', '13356789431', '', '127.0.0.1', '3', '1');
INSERT INTO `f_info` VALUES ('46', '4', '165', '18.5Е╞╦Ф╤╡Ф≥╤Ф≤╬Г╓╨Е≥╗Д╦─Е▐╟Е┤╨Е■╝400Е┘┐', '9Ф√╟Г └19Е╞╦Е╝╫Е╠▐Ф╤╡Ф≥╤Г■╣Х└▒Ф≤╬Г╓╨Е≥╗О╪│О╪│Е╟╠Д╦─Е▐╟&nbsp;Е╟╠Д╦─Е▐╟&nbsp;Д╦─Е▐╟Д╬©Е╝°Е█√&nbsp;Д╦█Х╝╗Д╩╥Х©≤Д╩╥О╪│<br />\r\n<br />\r\nД©²Х╞│Ф√╟Е╠▐О╪▄5Д╦┤Е╟▐Ф≈╤Е▐╞И²═Ф─╖Ф▄┤Ф═┤О╪│&nbsp;ФЁ╗Ф└▐Ф≤╞Г▒∙Г√╣Е╠▐О╪┬Ф≤╞Е╠▐Е╧∙Д╦┼И²╒Ф°┴Е┤═Ф═╧Г╨©Ц─│Д╦█Е╫╠Е⌠█Д╫©Г■╗Е╞©Е▒╫Е▓▄Х╢╗И┤▐Ц─┌<br />\r\nЦ─░Х╖└&nbsp;Ф═╪&nbsp;Е▐┌&nbsp;Ф∙╟Ц─▒&nbsp;<br />\r\nД╨╖Е⌠│Ф─╖Х┐╫Ф▄┤Ф═┤О╪ <br />\r\nГ╢╒Е╟╪<br />\r\nГ╠╩Е·▀&nbsp;TFT-LCD&nbsp;<br />\r\nЕ╟╨Е╞╦:&nbsp;Ц──18.5Е╞╦&nbsp;Е╝╫<br />\r\nФ≤╬Г╓╨Ф╗║Е╪▐&nbsp;SXGA&nbsp;<br />\r\nГ┌╧Х╥²О╪┬Ф╞╚Г╠ЁО╪┴&nbsp;0.294&nbsp;<br />\r\nИ╒°Х┴╡Г └Ф∙╟Е╜≈&nbsp;16.2M&nbsp;<br />\r\nЕ╞╧Ф╞■Е╨╕&nbsp;800:1&nbsp;<br />\r\nД╨╝Е╨╕&nbsp;500&nbsp;<br />\r\nФ°─Е╓╖Е┬├Х╬╗Г▌┤Ц─│Е┬╥Ф√╟Г▌┤О╪ 1440ц≈900<br />\r\nЕ⌠█Е╨■И─÷Е╨╕:&nbsp;Ц──4ms<br />\r\nФ╟╢Е╧ЁЕ▐╞Х╖├Х╖▓Е╨╕:&nbsp;Ц──180Е╨╕<br />\r\nЕ·┌Г⌡╢Е▐╞Х╖├Х╖▓Е╨╕:&nbsp;Ц──140Е╨╕<br />\r\nЕ┘╥Ф°┴Е╝▄Ф∙╢Г └Е▄┘Хё┘<br />\r\nФ▌╔Е▐ё&nbsp;15И▓┬Ф≥╝И─ Ф▌╔Е▐ё<br />\r\n<br />\r\nИ┘█Д╩╤&nbsp;Ф≤╬Г╓╨Е≥╗1Е▐╟,Г■╣Ф╨░Г╨©,&nbsp;<br />\r\nИ─┴Ф▀╘Ф╤╡Ф≥╤Г └Д╦┴Е╓╖Г░├Г■╠О╪ <br />\r\n1.&nbsp;Е┼÷Х─≈Д╫▌Ц─│Г°│Г■╣Х╢╧О╪ Д╦─Х┬╛CRTФ≤╬Г╓╨Е≥╗Е┼÷Х─≈Ф°┴100WО╪▄Х─▄Ф╤╡Ф≥╤Ф≤╬Г╓╨Е≥╗Е▐╙Ф°┴35WО╪▄Д╩╔Ф╞▐Е╓╘Е╪─10Е╟▐Ф≈╤О╪▄Г■╣Х╢╧1Е┘┐/Е╨╕Х╝║Г╝≈О╪▄Д╦─Е╧╢Д╦▀Ф²╔Г■╗Ф╤╡Ф≥╤Е▐╞Г°│240Е┘┐Г■╣Х╢╧О╪▄Х©≤Е▐╞Г╪⌠Х╖ёГ⌡╝Е┴█Г■╣Е┼⌡Г╢╖Е╪═Е╠─И²╒Ц─┌<br />\r\n2.Ф°┴Е┬╘Д╨▌Е│╔Е╨╥О╪ Ф╤╡Ф≥╤Ф≤╬Г╓╨Е≥╗Ф≈═Г■╣Гё│Х╬░Е╟└Ц─│Ф≈═И≈╙Г┐│О╪▄Г°╪Г²⌡Д╦█Д╪ Ф└÷Е┬╟Е┼ЁГ╢╞Е╧╡Ф╤╘О╪▄Х©≥Е╞╧И∙©Ф°÷Д╩╔Ф²╔Е⌡═CRTФ≤╬Г╓╨Е≥╗Х─▄Е▐≈Е┬╟Е╞╧Г ╝Х┌╓Е▓▄Г°╪Г²⌡Д╧┐Х┤ЁХ╨╚Д╫⌠Е│╔Е╨╥Е╫╠Е⌠█Г └Д╨╨Е▒≤Ф²╔Х╝╡Ф≈═Г√▒Ф≤╞Ф°─Е╓╖Г └Г╕▐И÷ЁЦ─┌<br />\r\n3.Е╝║Г╬▌О╪ CRTФ≤╬Г╓╨Е≥╗Е╓╙Е╓╖Е╓╙И┤█О╪▄Е╓╙Е█═Г■╗Ф║▄И²╒Г╘╨И≈╢О╪▄Д╧÷Д╦█Г╬▌Х╖┌О╪▄Д╦█Г╛╕Е░┬Г▌╟Д╩ёГ╬▌Е╜╕Г └Ф┬©И≈╢Хё┘Ф╫╒Е╦┐Е╠─', '/uploads/201304/5_127091298426921_100X75.jpg', '4', '1270913093', '1270913093', '', 'Ф²▌Е╟▐Е╖░', '13356789543', '', '127.0.0.1', '17', '1');
INSERT INTO `f_info` VALUES ('47', '4', '169', 'И÷╘Г┴┬Х©╥Д╫═Ф╠╫Х╫╕И╪═Ф═┤', 'И╒°Х┴╡О╪ Г╨╒О╪▄Г≥╫О╪▄Х⌠²О╪▄И╩▒О╪▄И⌠╤О╪⌡Е┘╠Д╨■Г╖█Х┴╡,USBФ▌╔Е▐ё<br />\r\n<br />\r\nГ▌╟Е╓└Г░├Д╩╥30Е┘┐О╪▄Х╢╗И┤▐Г╩²Е╞╧Ф╡║И≈╝И╒≤О╪│О╪│О╪│Е▐╞Д╩╔Е╫⌠И²╒И╙▄Х╢╖<br />\r\n<br />\r\nИ╪═Ф═┤Г └Ф╩ Г▐═О╪▄Ф≤╞7Е╫╘Г│╞О╪▄Ф≥ Д╦┼Г°▀Е╬┬Ф╪┌Д╨╝О╪│О╪│О╪│<br />\r\n<br />\r\nХ╫╕Е┴█Ф≤╞Х⌠²Г│╞О╪▄Х╫╕Е░▌Ф≤╞Д╨╝Г╨╒Х┴╡Е╟╬Г│╞О╪▄<br />\r\n<br />\r\nД╦─Х╫╕Е°╗Ф┴▀О╪▄Х╝╘Д╫═Ф°┴Г²─И╘╬И╘╜Г └Д╨╚Е▐≈О╪│О╪│О╪│О╪│<br />\r\n<br />\r\nИ─┌Е░┬Е░└Г╖█Г╛■Х╝╟Ф°╛Е▓▄Е▐╟Е╪▐Г■╣Х└▒&nbsp;Д╦─Д╦╙Д╧÷И─│Х╢╖О╪▄Ф∙╟И┤▐Д╦█Е╓ О╪▄Х╞╥Ф┼⌠Г╢╖Ф≈╤И≈╢Е⌠÷О╪│', '', '0', '1270913832', '1270913832', '', 'Ф²▌Е╟▐Е╖░', '13356789431', '', '127.0.0.1', '2', '1');
