INSERT INTO `f_info` VALUES ('49', '4', '165', 'И╚≤Ф║ёГ⌡┬И─ A780Д╦╩Ф°╨22Е╞╦Ф╤╡Ф≤╬Е╓╖И┤▐Ф┴╧Е▐▒', 'Ф√╟Е┬╟И╚≤Ф║ёГ⌡┬И─ A780Д╦╩Ф°╨Е╓╖И┤▐Ф┴╧Е▐▒&nbsp;70Е╔≈<br />\r\nД╦╩Ф²©О╪ Г⌡┬И─ A780&nbsp;<br />\r\nCPUО╪ 4850+<br />\r\nЕ├┘Е╜≤О╪ 2G<br />\r\nФ≤╬Е█║О╪ Г⌡┬И─ 9600GT&nbsp;512M<br />\r\nЕ⌠│Г┴▄Ф°╨Г■╣<br />\r\nФ┴╧Е▐▒О╪ 1300Е┘┐<br />\r\n<br />\r\n<br />\r\nД╦╩Ф²©О╪ Ф≤┌Х╬╬NF5&nbsp;50Е╔≈<br />\r\nCPUО╪ 4000+<br />\r\nЕ├┘Е╜≤О╪ 1G<br />\r\nФ≤╬Е█║О╪ 8600GT&nbsp;256M<br />\r\nЕ⌠│Г┴▄Ф°╨Г■╣<br />\r\nФ┴╧Е▐▒О╪ 750Е┘┐<br />\r\n<br />\r\n<br />\r\nД╦╩Ф²©О╪ Г⌡┬И─ NF5<br />\r\nCPUО╪ 4400+<br />\r\nЕ├┘Е╜≤О╪ 2G<br />\r\nФ≤╬Е█║О╪ Г⌡┬И─ 2600XT<br />\r\nЕ⌠│Г┴▄Ф°╨Г■╣<br />\r\nФ┴╧Е▐▒О╪ 950Е┘┐&nbsp;<br />\r\n<br />\r\n<br />\r\n<br />\r\n<br />\r\nД╦╩Ф²©О╪ Г╡╬Х▀╠945<br />\r\nCPUО╪⌡P43.0<br />\r\nЕ├┘Е╜≤О╪ 1G<br />\r\nФ≤╬Е█║О╪ 8600GT&nbsp;256M<br />\r\nЕ⌠│Г┴▄Ф°╨Г╝╠Г■╣Ф╨░<br />\r\nФ┴╧Е▐▒О╪ 780<br />\r\nЕ█∙Е█√О╪ 830<br />\r\n<br />\r\n<br />\r\nД╦╩Ф²©:Ф≤┌Х╬╬NF5<br />\r\nCPU:3800+<br />\r\nЕ├┘Е╜≤:1G<br />\r\nФ≤╬Е█║:Ф≤┌Х╬╬7600GS&nbsp;256M<br />\r\nЕ╓ Е╫╘Ф°╨Г■╣<br />\r\nФ┴╧Е▐▒:650Е┘┐<br />\r\nЕ█∙Е█√:700Е┘┐<br />\r\n<br />\r\n<br />\r\n<br />\r\nФ╤╡Ф≥╤Ф≤╬Г╓╨Е≥╗<br />\r\n9.9Ф┬░Ф√╟22Е╞╦AOC&nbsp;09Е╧╢Г■÷Д╨╖&nbsp;850Ф┴╧Е▐▒&nbsp;10Е▐╟<br />\r\n9.8Ф┬░Ф√╟22Е╞╦Ф≤⌠Г╬▌И─┼&nbsp;H2216W&nbsp;850Ф┴╧Е▐▒&nbsp;120Е▐╟<br />\r\n<br />\r\n9.5Ф┬░Ф√╟22Е╞╦HKC&nbsp;820Е┘┐Ф┴╧Е▐▒&nbsp;30Е▐╟<br />\r\n9.5Ф┬░Ф√╟19Е╞╦Е╝╫Е╠▐Е╝▐Е÷╨&nbsp;X191W&nbsp;600Ф┴╧Е▐▒&nbsp;80Е▐╟<br />\r\n9.5Ф┬░Ф√╟19Е╞╦Е╝╫Е╠▐Ф≤⌠Г╬▌И─┼&nbsp;H192W+&nbsp;580Ф┴╧Е▐▒&nbsp;35Е▐╟<br />\r\n9Ф┬░Ф√╟19Е╞╦Ф═┤Е╠▐TOPVIEW&nbsp;550Ф┴╧Е▐▒&nbsp;20Е▐╟<br />\r\n9Ф┬░Ф√╟19Е╞╦Ф═┤Е╠▐И∙©Е÷▌&nbsp;И▓╒Е▄√Г▌╩Г▓┐&nbsp;550Ф┴╧Е▐▒&nbsp;100Е▐╟<br />\r\n<br />\r\n<br />\r\n<br />\r\nД╨╓Ф█╒Ф°╨<br />\r\nЕ╓╖И┤▐Е█┐Е┘├Д╨╓Ф█╒Ф°╨Ф╦┘Д╩⌠<br />\r\nЕ█▌Д╦╨Е█┐Е┘├Д╨╓Ф█╒Ф°╨&nbsp;24Е▐ё<br />\r\n<br />\r\nХ╥╞Г■╠<br />\r\n200B+&nbsp;1000Е┘┐&nbsp;Е▐╞Е╦╕&nbsp;100Е▐╟Д╩╔Д╦┼<br />\r\n3300B+&nbsp;1500Е┘┐&nbsp;Е▐╞Е╦╕100Е▐╟Д╩╔Д╦┼<br />\r\n<br />\r\n<br />\r\nФ°█Е┼║Е≥╗<br />\r\nЕ╓╖И┤▐Ф°█Е┼║Е≥╗Ф╦┘Д╩⌠<br />\r\nЕ▐╞Е╦╕20Е▐╟&nbsp;Г └Ф°█