INSERT INTO `f_info` VALUES ('51', '3', '166', 'Е╓▐Ф≈╔Г╘╨Х╟┐Ф┬©Д╦┼Г╫▒Е©┘Е╓┤Е╦╕Иё▌Ф┴┤Ф┼≤Е▐═Г╛■Х╝╟Ф°╛Г■╣Х└▒Ф║▄', 'Г┌▌Г┌▌Е╓▐Ф≈╔Е©╚Е┬╟Д╨├О╪▄Ф┐ЁХ╨╨Е°╗Г╘╨Х╟┐Ф┬©Д╦┼Г╫▒О╪▄Д╫├Е▐┬Ф╡║Ф°┴Г■╣Х└▒Ф║▄Ф─▌Д╧┬Е┼·Ц─┌Ф┬▒Д╩╛Е▐╞Д╩╔Е╦╝Д╫═Х╖ёЕ├ЁХ©≥Д╦╙И≈╝И╒≤Ц─┌Ф°╛Е╨≈Ф√╟Е┬╟E-tableГ╛■Х╝╟Ф°╛Г■╣Х└▒Ф║▄Ц─┌Е┘╗Ф┼≤Е▐═О╪▄Е┤╨Е╥╝Д╧÷Е▐╞Д╩╔Е╦╕Г²─Х╣╟Ц─┌Ц─┌Е┘╗Е⌡╫Г╩÷Д╦─И⌡╤Е■╝Д╩╥150Е┘┐&nbsp;Ф°╛Е╨≈Х©⌡Х║▄Д©┐И■─Г▌╟Д╩╥Е▐╙Х╕│95Е┘┐О╪┬Е█≈Ф≤▄Е╦┌Е├┘Е┘█Х╢╧И─│Х╢╖Д╦┼И≈╗О╪┴', '', '0', '1270958251', '1270958251', '', 'Е╪═Г■÷', '13356789431', '', '127.0.0.1', '19', '1');
INSERT INTO `f_info` VALUES ('52', '3', '32', 'Д╬©Е╝°Е■╝Б─°И┤▒Ф╣╥И╘╛Б─²Е│╔Х╨╚Е█┼Е╧╢Е█║', 'Ф°╛Д╨╨Ф°┴&nbsp;И┤▒Ф╣╥И╘╛Е│╔Х╨╚Д©╠Д╧░И┐╗&nbsp;Б─°Е█┼Е╧╢Е█║Б─²&nbsp;2Е╪═О╪▄&nbsp;Е╝≤Ф√╧Ф┼╔Д╩╥800Е²≈1Е╪═О╪▄Г▌╟Е⌡═Ф°┴Д╨▀500Е²≈1Е╪═Ф┬√950Е²≈2Е╪═Х╫╛Е┤╨Е▌╩О╪▄Ф°┴И°─Х╕│Г └Ф°▀Е▐▀Х│■ГЁ╩Ф°╛Д╨╨QХ│┼О╪ &nbsp;ФЁ╗Ф≤▌Ф≤╞Х╢╜Е█║...&nbsp;Ц─┌Ф╜╓Е█║Х╢╜Д╧╟Х─┘Е▐╞Д╩▌Ф©─Ф╢╩Ф≈╔Е╪─Е╖▀Г╝≈Ф≈╤И≈╢О╪▄Е█┼Е╧╢Е├┘Ф≈═И≥░Ф╛║Ф∙╟Е│╔Х╨╚Ц─┌&nbsp;И²·Е╦╦И─┌Е░┬Е▌╩И┤▒Ф╣╥И╘╛Е│╔Х╨╚Г └Ф°▀Е▐▀Ц─┌Ф°╨Д╪ Д╦█Е╓ О╪▄&nbsp;Е■╝Е╝▄Д╦█Е├█Ф°┴Ц─┌<br />\r\nИ°─Х╕│Е█║Г └Ф°▀Е▐▀Х│■ГЁ╩Ф°╛Д╨╨QХ│┼О╪ ,&nbsp;ФЁ╗Ф≤▌Ф≤╞Х╢╜Е█║&nbsp;(Ф°╛Д╨╨И∙©Ф°÷И ░Х╨╚Е°╗Г╨©)<br />\r\nФ°╛Е█║Е▐╞Д╨╚Е▐≈Г └Е│╔Х╨╚И║╧Г⌡╝Ф°┴:Ф▀┴Д╦│Ц─│Г▒°Г▐┬Ц─│Х┌ Г ╝Х┬·Ц─│Х║≈Х┬·Ц─│Е│╔Х╨╚Ф⌠█Ц─│Ф╟▒Ф≈▐Х┬·Г╜┴Е░└Г╖█Е╫╒Д╫⌠Х┬·Ф⌠█;Е┼╗Ф└÷Е█∙Х╫╕Ц─│Ф°┴Ф╟╖Е≥╗Ф╒╟Ц─│Х╥▒Ф╜╔Ф°╨Ц─│Е┼⌡И┤▐Х╝╜Г╩┐Ц─│Ф√╞Ф╢⌡Е┘▀Ц─│Ф║▒Ф▀©Ф╥▀Ф╣╢;Е┘█Х╢╧Г°▀Г■╣Е╫╠Ц─│Д╦┼Г╫▒Х│┼Е╓╘Ц─│Д╧▓Д╧⌠Г░┐Г╬╫Ф╞⌡Г░┐Ц─┌Ф°┴Г╘╨Х╟┐Е╪─Ф■╬Е▓▄Ф╦╦ФЁЁИ╕├Х©≤Ф°┴Г╫▒Г░┐Г╜┴Е°╨Ф┴─О╪▄&nbsp;Г╩²Е╞╧И╚≤Ф║ёЦ─┌<br />\r\nЕ┤╜Е█║Х©≤Е▐╞Е┘█Х╢╧Д╨╚Е▐≈Ф║▒Ф▀©О╪▄Е├╥Г┐╜Ф╟╢Е├╡Е┤┴Ф╡░Ф╣╢Х╝╬Е╓┤Б─╕.Е┘█Х╢╧Г └Ф╡░Ф╣╢И°╡Ц─│Ф╢≈Е▐▒Ф╟╢Ц─│Г░├Е╝╧Г■╗Е⌠│Ц─│Ф▀√И·▀Г╜┴~~~~&nbsp;<br />\r\n<br />\r\nЕ┘╗Е█≈Ф≤▄Е▐╞Ф°┴Д╦┴Е╝╤Е╨≈И┐╫Е▐╞Д╩╔Г■╗Ц─┌&nbsp;Е┬├Е┬╚Ф≤╞Д╦┴Д╦╙Е╨≈О╪┬Ф╜╔Х║▄Х║≈Г └Г┌╚Х╟╥И²▓Е╧╢Х║≈4Ф╔╪О╪▄И²▓Е╠╠Ф╧√И┤▒Х┴╡Ф╟╢Е╡╦5Ф╔╪О╪▄Е█≈Ф≤▄Е╦┌Х╢╒Е╞▄Е╧©Е°╨6Ф╔╪О╪┴Д╦┴Д╦╙Е╨≈И┐╫Е▐╞Д╩╔И─ Г■╗О╪▄Д╦█И≥░Ф╛║Ф∙╟...<br />\r\n<br />\r\nИ²·Х╞ Е▀©Ф┴╟О╪▄Д╦█Ф▌╔Е▐≈Х╝╗Д╩╥Х©≤Д╩╥Х─┘Ц─┌&nbsp;Х╟╒Х╟╒~', '', '0', '1270958496', '1270958496', '', 'Ф²▌Е┘┬Г■÷', '13356789543', '', '127.0.0.1', '48', '1');
