INSERT INTO `f_info` VALUES ('83', '4', '240', 'Ц─┼Е╓▐Е╗┐Д╧▀Г╖─Е├┘Х║ёД╩╥Ф═╪{Е⌡╬}Е╓▐Е╗┐Д╧▀Г╖─И╜■Е┼⌡Ф▄╨Ц─▀Д╦┴Ф≤÷Е┤╨Е■╝', 'Ф╣≥Ф╠÷Ф╟╦Е╨╥Е╦┌Д╦┴Ф≤÷Г╓╪Е⌠│Е┬╤И─═Ф°┴И≥░Е┘╛Е▐╦Ф▐░Д╬⌡-Е╓▐Е╗┐Д╧▀Г╖─И╩└И┤▒Г■╡Ц─┌<br />\r\nЕ╓▐Е╗┐Д╧▀Г╖─И╜■Е┼⌡Ф▄╨,,Е╓▐Е╗┐Д╧▀Г╖─И╜■Е┼⌡Ф▄╨,И≤©Ф°╣Д╩ёХ╗─,Д╦─Г╘©Е╟╠Ф▄╨.Е╝┐И─ Х©┤Д╦▀Е▌ Д╦┼Х√└Г └Ф┴≤Х┐╦Х╝╬Х╝║,Д╦▌Х┐╦И┐╗Е╝▄Г╬▌Х╢╢Е░┬,Г╘©Д╦┼Е╝┐,Е╟╠Х┐╫И ▐Х╣╟Е┼╗Е╪─Е╖▀Ф▄┴Ф▒╘Х┐╦И┐╗,Д╫═Г └Д╧ЁФ┬©Х╬╧Е▒╪Е░╦Х╬╧ФЁ╒Е┼╗.Г▌╟Е°╗Д╨▄Ц─│И≈╝О╪ Ф√┤Х┐╦Д╦╨Д╩─Д╧┬Д╪ Ф°┴Х┌┴Ф└÷О╪÷<br />\r\nГ╜■О╪ Е⌡═Д╦╨Е╓▐Е╗┐Д╧▀Г╖─Ф√┤Х┐╦Г╫╘Ф²╞И┤┤Г■╗Г╡╬И─┴Ф╘║Х┐╤Ф═▒Д╧ЁФ╠│Г╡╬Г┌╪Х─▄Ф┬░О╪▄Е┼═Д╩╔Д╨╨Д╫⌠Е╜╕Ц─│Д╩©Г■÷Е╜╕Д╦╨Г░├Х╝╨Ф▄┤Е╞╪О╪▄Х╝╬Х╝║Е┤╨И┤█И┤▐Ф└÷Ц─│Ф┴▀Ф└÷Д╦▌Д╨╨Д╫⌠Д╧ЁФ┬©Г └Ф╞■Д╬▀Д╦╨1О╪ 1О╪ 1О╪▄Х┌┴Ф└÷Д╩©Г°÷Е╨╕Е°╗95%Д╩╔Д╦┼О╪▄Х┐╫Х╬╬Е┬╟Д╦▌Д╧ЁФ┬©Ф╣▒Г└╤Д╦─Д╫⌠Г └Ф∙┬Ф·°О╪▄Г╘©Г²─Г┴╧Е┬╚Х┬▓И─┌О╪▄Е╝▄Е┘╗Ф╡║Ф°┴И┤█И┤▐Ф└÷Х╖┴Ц─┌<br />\r\nД╦┴Ц─│И≈╝О╪ Ф√┤Х┐╦Д╦╨Д╩─Д╧┬И°─Х╕│Ф°┴И┤█И┤▐Ф└÷О╪÷<br />\r\nГ╜■О╪ Х┌┴Ф└÷Е▄┘Ф▀╛И┤█И┤▐Ф└÷О╪▄Д╦▌Д╨╨Д╫⌠Г⌡╦Е░▄Ф╞■Д╬▀Г └И┤█И┤▐О╪⌡Г╛╛Д╦─Ц─│Х┐╫Е╦╕Г╩≥Е╔ЁФ─╖Е┘╗Ф√╟Д╨╡Х┌╓Г └Ф└÷Х╖┴О╪▄Х┤╙Г└╤Ц─│Е┼╗Ф└÷Ц─│Ф°┴Е╪╧Ф─╖О╪⌡Г╛╛Д╨▄Ц─│И─╪Г°÷Г └Ф└÷Х╖┴Е╦╕Г╩≥Е╔ЁФ─╖Ф⌡╢Е╓ Г └Х┤╙Д©║Ц─┌Г╛╛Д╦┴Ц─│Е╔ЁФ─╖Г╘©Г²─Ф√┤Х┐╦О╪▄Ф°┴И─┌Е╫⌠Г └И┤█И┤▐Д╫©Е╬≈Д╧ЁФ┬©Д╦█Ф≤⌠Г╖╩Д╫█Ц─┌<br />\r\nЕ⌡⌡Ц─│И≈╝О╪ Ф√┤Х┐╦Ф°┴Е╜■Е╟╠Х┐╫И─▐Ф╟■Е░≈О╪÷<br />\r\nГ╜■О╪ Г▌╟Е°╗Е╓╖И┐╗Е┬├И─▐Ф╟■Ф√┤Х┐╦Г └Г╫╘Ф²╞Е╜■И┐╫Ф≤╞Г⌡╢Г └О╪▄Е▐╙Х┐╫Х╝╘Е┘╤Д╦╜Д╦─И┐╗Е┬├Х┌▄Х┌╓И─▐Ф╟■О╪▄Х─▄И┤┤Г■╗Е╓╘Г└╤Ф╘║Х┐╤О╪▄Е╧╤Е┬╘Г■╗Д╩©Г■÷Е╜╕Х°┌Г╙²Е▌÷Г░├О╪▄Г╖▒Е╜╕Г └Х╝╬Х╝║Е┤╨Е┘╜Г≥╬Д╦╙Ф°┴Ф√╧Е░▒Ф▌▓Е┬≈Г └И─▐Ф╟■Е╜■О╪▄Е╜■Г╝║Ф°┴Д╦─Е╝ И∙©Е╨╕О╪▄Е┼═Д╧▀Ф╘║Х┐╤Ф÷■Х╫╞Х╢╗Ф└÷О╪▄Е╔ЁФ─╖Е°╗Х╣╟Е┼╗Е╟╠Х┐╫Ф°┴Ф∙┬Х┤╙Е┼╗И─▐Ф╟■Ц─│Е╞╧Ф╣│Ф█╒Ф╟╖Ц─┌<br />\r\nД╨■Ц─│И≈╝О╪ Ф▄┴Ф▒╘Е╞╧Д╧ЁФ┬©Г └Е╔╫Е╓└О╪÷<br />\r\nГ╜■О╪ Ф▄┴Ф▒╘Д©²Е│╔Е┼÷Х┐╫Х┐╫Ф°┴Ф∙┬Г └Д©┐Х©⌡Х║─Ф╤╡Е╬╙Г▌╞О╪▄Е╓▐Е╗┐Д╧▀Г╖─Е┬╘Г■╗Ф÷■Х╫╞Е╓╘Г└╤Ф²░Х╢╗О╪▄Д╦█Е▌▀Х©╚Д╧ЁФ┬©О╪▄Д╫©Е╔ЁФ─╖Е°╗Ф≈╔Е╦╦Г■÷Ф╢╩Д╦╜Е╟╠Х┐╫Х╬╬Е┬╟Ф┼ Ф▒╦Е╪▐Д╦█И≈╢Ф√╜Ф▄┴Ф▒╘О╪▄Г╖╟Д╧▀Д╦╨Е╝▄Г╬▌Ф▄┴Ф▒╘Ф∙┬Ф·°Ц─┌<br />\r\nЕ╝≤Ф√╧Г╫▒Е²─О╪ www.sxzz369.com', '/uploads/info/201604/14596168399132_100X75.jpg', '4', '1272073320', '1459616848', '', 'Е┬≤Е┘┬Г■÷', '13588614508', '', '127.0.0.55', '128', '1');
