INSERT INTO `f_info` VALUES ('89', '3', '602', 'Ф▒╘Ф┴≤Г╫≈Ф▀┴Е┘╛Е▐╦Ф▀⌡Х│≤Ф√┤Е▒≤', 'Ф▒╘Ф┴≤Г╫≈Ф▀┴Е┘╛Е▐╦Ф▀⌡Х│≤Ф√┤Е▒≤<br />\r\nХ╕│Ф╠┌Е╧╢И╬└18-30Е▒╗Е╡│&nbsp;Е╫╒Х╠║Ф╟■Х╢╗Д╫Ё&nbsp;Х╨╚Д╫⌠Е│╔Е╨╥&nbsp;Г├÷Ф┌┴Е┼·Е┘╛Е╝╓Х╫╞Д╩╤Ф°┴Г┬╠Е╡≈Ф∙╛Д╦ Г╡╬Г╔·Е╬┘И│┤Е÷╨Ф°╛Е╥╔Х╣└1800Е┘┐&nbsp;Ф°┴Х║╔Е┼╘Ф°┴Е╔√И┤▒&nbsp;Ф°┬Х√╙Е°╗2500Е╥╕Е▐Ё&nbsp;Е▄┘Иё÷Е╝©&nbsp;Ф°┴Г▐╜Х╫╕Д╦┼Д©²И≥╘Е╓√Е°╟Ф┬╥Е▐ёД╨■И≥╘8Е╟▐Ф≈╤Ф╜ёЕ╦╦Г▐╜&nbsp;Е▐▄Д╪▒Ф≈╔&nbsp;Е▐╞Д╨╚Е▐≈Е⌡╫Е╝╤ФЁ∙Е╝ Х┼┌Е│┤Ф≈╔Д╦╩Х╕│Х╢÷Х╢ёЕ░└Г╖█Х╣└Ф√≥Ц─│Ф√┤Д╩╤Ц─│Ф║ёФ║┬Г └Ф■╤И⌡├Ц─│Ф■╤Е▐▒Ц─│Е┬╤Д╫°Ц─│Ф┴⌠Е█╟Ц─│Е╓█Е█╟Е▓▄Е╜≤Ф║ёД©²Г╝║Е╥╔Д╫°О╪▄Г├÷Г╩┐Е╨■Г■╗officeЕ┼·Е┘╛Х╫╞Д╩╤О╪▄Г├÷Г╩┐wordГ╜┴Г⌡╦Е┘ЁХ╫╞Д╩╤О╪⌡Е╞╧Е╥╔Д╫°Х╝╓Г°÷Х╢÷Х╢ёЦ─│Г╩├Х┤╢Ц─│Д╦╔Х╟╗О╪▄Ф°┴Х┴╞Е╔╫Г └Ф²║Г░├Ф─╖Ц─│Х╬┐Е╪╨Г └Х╝╟Е©├Е┼⌡О╪⌡Г╖╞Ф·│Х©⌡Е▐√О╪▄Х│╙И╒√Е╔╫Е╜╕О╪▄Е╥╔Д╫°Е©┐Ф─│Г╗ЁЕ╝ Ц─│Х╦▐Е╝·Х┌╞Е╧╡О╪▄Ф°┴Х┴╞Е╔╫Г └Е⌡╒И≤÷Г╡╬Г╔·Е▄┘Иё÷Е╝©&nbsp;Ф°┴Г▐╜Х╫╕Д╦┼Д╨■И≥╘Ц─┌&nbsp;И²╒Х╞∙Х╞╥Ф░╨Е╦╕Х╨╚Д╩╫Х╞│Е▌÷Д╩╤Ц─│Х╨╚Д╩╫Х╞│Е╓█Е█╟Д╩╤Д╦┴Е╪═Ц─│Д╦─Е╞╦Г┘╖Г┴┤Д╦┴Е╪═,Г╝║Д╫▐Г╝║Д╫▐,Д©²Д╨■И≥╘.Ф°┴Ф└▐Х─┘Х╞╥Х│■ГЁ╩Ф┬▒Д╩╛О╪▄Е╜≥Е┘┬Г■÷О╪▄&nbsp;Е°╟Г┌╧О╪ Е╓╘Ф╢╔Е║≤Ф╡╫.', '', '0', '1271807125', '1271807125', '', 'Е╜≥Е┘┬Г■÷', '18920779168', '', '127.0.0.1', '1', '1');
