INSERT INTO `f_info` VALUES ('91', '3', '546', 'Д╪ Х╝║--Ф╣▌Е╝│Г╖▒Е°ёГ╖▒Ф┼─Ф°┴И≥░Е┘╛Е▐╦', 'Ф┼─Х┐╫Х╕│Ф╠┌О╪ &nbsp;Ф°┴Д╪ Х╝║Х╣└Ф═╪Х╞│О╪▄Ф°┴Д╦╜Г╨╖Д╪ Х╝║Е╦┬Х╣└Ф═╪Х╞│Д╧╕Х─┘Д╪≤Е┘┬&nbsp;Ф°┴Д╪ Х╝║Е┘╛Е▐╦Е╥╔Д╫°Г╩▐И╙▄,Г├÷Г╩┐Ф⌠█Д╫°Х╢╒Е┼║Х╫╞Д╩╤&nbsp;Х┴╞Е╔╫Ф╡÷И─ Х┐╫Е┼⌡О╪▄Е┘╥Ф°┴Ф∙╛Д╦ Г╡╬Г╔·&nbsp;Ф▀⌡Х│≤Е╓√Е▀╓Д╪ Х╝║:&nbsp;1Ц─│Г⌡╦Х╡▄Г╚╞Ф╜ёО╪▄Е░┐Х▀╕Х─░Е┼ЁО╪▄Х┐╫Ф┴©Ф▀┘И╚≤Е╪╨Е╨╕Е╥╔Д╫°Ц─┌&nbsp;2Ц─│Х┴╞Е╔╫Г └Ф╡÷И─ Е▐┼Г▀╛Г╚▀Е╓└Г░├И≈╝И╒≤Г └Х┐╫Е┼⌡Ц─┌&nbsp;3Ц─│Е┘╥Ф°┴Х╢╒Е┼║Е▐┼Г╗▌Е┼║Г÷╔Х╞├Ц─┌&nbsp;4Ц─│Е┘╥Ф°┴Д╪ Х╝║Е┘╛Е▐╦Е╥╔Д╫°Г╩▐И╙▄Х─┘Д╪≤Е┘┬Х─┐Х≥▒,Х√╙И┤▒И²╒Х╝╝.&nbsp;Д╦╩Х╕│Е╥╔Д╫°Е├┘Е╝╧О╪ &nbsp;Е┬╟Е╝╒Ф┬╥Е╓└И─│Е▐√Д╦─Д╨⌡Г╔╗Ф█╝О╪▄Е┬╟Г╗▌Е┼║Ф┴─Ф┬√Е╥╔Е∙├Ф┴─Е┼·Д╦─Д╨⌡Д╨▀Ф┐┘О╪⌡&nbsp;Е▌╩Г╗▌Е┼║Г■ЁФ┼╔Г╨ЁГ╗▌О╪⌡Е▌╩И⌠╤Х║▄Г╪╢Г╨ЁГ╗▌Ф╛╬О╪⌡&nbsp;Д╦▌Е╝╒Ф┬╥Х│■ГЁ╩Е▐√И─│Х╣└Ф√≥О╪⌡&nbsp;Х╬┘Е┼╘Д╪ Х╝║Е╥╔Д╫°О╪⌡', '', '0', '1271807697', '1271807697', '', '', '15305475493', '', '127.0.0.1', '2', '1');
