INSERT INTO `f_info` VALUES ('97', '3', '501', 'Г╬▌Г └Г■╣Е≥╗Ф╣▌Е╝│Г╩▐И■─Е╓└Ф▀⌡Х│≤Е∙├Х╤┘Х░╔Д╦ Е▒≤10Е░█', 'Г╬▌Г └Г■╣Е≥╗Ф╣▌Е╝│Г╩▐И■─Е╓└Ф▀⌡Х│≤Е∙├Х╤┘Х░╔Д╦ Е▒≤10Е░█О╪│<br />\r\nХ╕│Ф╠┌О╪ Е╔ЁФ─╖О╪▄Е╧╢И╬└35Е╡│Д╩╔Д╦▀О╪▄Е╫╒Х╠║Ф╟■Х╢╗Д╫ЁО╪▄Ф°┴Е∙├Х╤┘Е╥╔Д╫°Г╩▐И╙▄Д╪≤Е┘┬О╪│<br />\r\nЕ╥╔Д╫°Е°╟Г┌╧О╪ Е█▌Ф╤╕Х▀▐Ф·°Х╤┘Е╦┌Ц─│Д╧²И╬≥Е╝╤Г■╣Ц─│Х▀▐Е╝│Г■╣Е≥╗Е╓╖Е█√Е°╨Ц─│Е╓╘Е╝┴Е╝╤Г■╣<br />\r\nЕ╬┘И│┤О╪ Х╞∙Г■╗Ф°÷Д╦─Д╦╙Ф°┬О╪▄Х╞∙Г■╗Ф°÷Х©┤Е░▌Ф╞▐Ф°┬560Е┘┐Е╨∙Х√╙Ф▐░Ф┬░', '', '0', '1271907405', '1271907405', '', 'Е╬░Г╩▐Г░├', '13953709300', '', '127.0.0.1', '1', '1');
INSERT INTO `f_info` VALUES ('98', '3', '611', 'Ф╣▌Е╝│Е©┐Ф≥╨Ф∙≥Х┌╡И╚≤Х√╙Ф▀⌡Х│≤Д╦⌠Е┘╪Х│▄', 'Х┤╙Д╧═Х─│Е╦┬О╪ Ф≥ 7Г┌╧Е┬╟9Г┌╧&nbsp;Х╢÷Х╢ёЕ╜╕Г■÷Г └Д╫°Д╦ Фё─Ф÷╔&nbsp;Г╖▒Г⌡╝Ф∙╟Е╜╕&nbsp;Г┴╘Г░├&nbsp;Е▄√Е╜╕<br />\r\n<br />\r\nЕ█∙Г╖▒Ф▌┬Х╞╬Х─│Е╦┬О╪ Е▒╗Ф°╚&nbsp;Х╢÷Х╢ёЕ╜╕Г■÷Г └Г╖▒Г⌡╝Е┼═Е╪╨&nbsp;Е┤╨Е█╥Х─┐И╒≤Д╦▌Х╝╡Х╖ё<br />\r\n<br />\r\nЕ╦┌Е°╨Ф▌╗Е╧©О╪ Х╢÷Х╢ёФ°╛Д╦╜Е©┐Д╦ Е┼║Г └Ф▌╗Е╧©О╪▄Ф∙≥Ф²░&nbsp;Ф∙≥Е┼║&nbsp;Е©┐Ф≥╨Е╪─Е▐▒&nbsp;Ф╦═И│⌠Е╪─Е▐▒<br />\r\n<br />\r\nД©║Ф│╞Д╦⌠Е▒≤О╪ Х╢÷Х╢ёИ┤┤И⌡├Е╝╒Ф┬╥Д©║Ф│╞&nbsp;Г╩┬Г╚╞Д╦ Е┼║Е╪─Е▐▒&nbsp;Е╦┌Е°╨Д©║Ф│╞&nbsp;Г╫▒Г╩°Х░╔И■─', '', '0', '1271912530', '1271912530', '', 'И╚≤ФЁ╒', '13563714260', '', '127.0.0.1', '2', '1');
