INSERT INTO `f_info` VALUES ('131', '3', '541', 'Г╬▌Г └Г■╣Е≥╗Ф╣▌Е╝│Г╩▐И■─Е╓└Ф▀⌡Х│≤Е∙├Х╤┘Х░╔Д╦ Е▒≤10Е░█', 'Г╬▌Г └Г■╣Е≥╗Ф╣▌Е╝│Г╩▐И■─Е╓└Ф▀⌡Х│≤Е∙├Х╤┘Х░╔Д╦ Е▒≤10Е░█О╪│<br /><br />Х╕│Ф╠┌О╪ Е╔ЁФ─╖О╪▄Е╧╢И╬└35Е╡│Д╩╔Д╦▀О╪▄Е╫╒Х╠║Ф╟■Х╢╗Д╫ЁО╪▄Ф°┴Е∙├Х╤┘Е╥╔Д╫°Г╩▐И╙▄Д╪≤Е┘┬О╪│<br /><br />Е╥╔Д╫°Е°╟Г┌╧О╪ Е█▌Ф╤╕Х▀▐Ф·°Х╤┘Е╦┌Ц─│Д╧²И╬≥Е╝╤Г■╣Ц─│Х▀▐Е╝│Г■╣Е≥╗Е╓╖Е█√Е°╨Ц─│Е╓╘Е╝┴Е╝╤Г■╣<br />Е╬┘И│┤О╪ Х╞∙Г■╗Ф°÷Д╦─Д╦╙Ф°┬О╪▄Х╞∙Г■╗Ф°÷Х©┤Е░▌Ф╞▐Ф°┬560Е┘┐Е╨∙Х√╙Ф▐░Ф┬░', '', '0', '1271920112', '1271920112', '', 'Е╬░Г╩▐Г░├', '13953709300', '', '127.0.0.1', '0', '1');
