INSERT INTO `f_info` VALUES ('179', '3', '574', 'О╪│Ф▀⌡Д╦⌠Х│▄ Е┘╪Х│▄Д╨╨Е▒≤', '<br /><br /><br />И∙©Ф°÷Ф▀⌡Е▐▒Д╪═Е█∙Д╨╨Е▒≤Д╦─Е╓╘30-40Е┘┐Ф≈╔Г╩⌠О╪│Г■╥Е╔ЁД╦█И≥░<br /><br />Е┼·Е┘╛10Е░█ Г■╥Е╔ЁД╦█И≥░ Ф°┬Х√╙800-1500Е┘┐<br /><br />Д╩⌠Г╝║8Е░█ Г■╥Е╔ЁД╦█И≥░ Ф°┬Х√╙800-1500Е┘┐<br /><br />Ф≥╝Е╥╔60Е░█ Г■╥Е╔ЁД╦█И≥░ Ф°┬Х√╙1200-2000Е┘┐<br /><br />Е┤╨Г╨ЁД╪ Х╝║5Е░█ Ф°┬Х√╙800-2000Е┘┐<br /><br />Хё┘Е█╦Е╥╔20Е░█ Д╦─Е╓╘60-100Е┘┐<br /><br />Х╥÷Х╫╕10Е░█ Г■╥1000-1500Е┘┐<br /><br />Е╓╖Е╟▐Х╫╕Е▐╦Ф°╨10Е░█ Ф°┬Х√╙1000-3000Е┘┐<br /><br />Д©²Е╝┴10Е░█Ф°┬Х√╙900-1300Е┘┐О╪┬Ф≈═Ф┼╪И┤▒<br /><br />Д╩╔Д╦┼Д╨╨Е▒≤Е²┤8Е╟▐Ф≈╤Е█∙Д╪▒ Ф▐░Д╬⌡Иё÷Е╝©<br /><br />', '', '0', '1271920133', '1271920133', '', 'Ф╒│Г╩▐Г░├', '15263707465', '', '127.0.0.1', '0', '1');
