INSERT INTO `f_info` VALUES ('183', '3', '522', 'Д╪ Х╝║Е╝·Ф┬≤Е÷╧Х╝╜----Д╦⌠Д╦ Х─│Е╦┬Д╦▌Е╜╕Е▒≤Д╦─Е╞╧Д╦─О╪┬Е╦╕Е╜╕Е▒≤О╪▄Е▄┘Д╪ О╪┴', 'Ф▀⌡Д╪ Х╝║Е╜╕Е▒≤О╪┬Г°÷Ф╜ёЕ©╚И─÷Х╦▐Е┘╔Д╪ Х╝║Х║▄Д╦ О╪┴<br />Б≤┘Х╢╒Е┼║Д╦⌠Е╝╤Д╦▌Е╜╕Е▒≤И²╒Е╞╧И²╒Б≤┘Е┘╗И²╒Ф─╖Ф▌▄Ф▐║Д╪ Х╝║Е╥╔Д╫°Б≤┘Ф▌╗Х█░Е╥╔Д╫°Б≤┘Е╜╕Е▒≤Ф╩║Ф└▐Е╨╕Ф°─И╚≤<br />Д╦╨Е╦╝Е┼╘Д╪ Х╝║Г┬╠Е╔╫Х─┘Ц─│Е╨■Е╠┼Д╪ Х╝║Е╜╕Е╓╖Е╜╕Г■÷Х┐╫Е╓÷И║╨Е┬╘Е▐┌Е┼═Е╥╔Д╫°О╪▄Г╙│Г═╢Е°╗Д╪ Х╝║Г∙▄Г╪╨Д╧▐Е╝·Х╥╣Г╩▐И╙▄О╪▄Г╪╨Д╧▐Д╪│Д╦ Ф┴─И°─Г └Д╦⌠Д╦ Ф┼─Х┐╫О╪▄Г┴╧Х╝╬Д╦─Д╦╙Ф█╥Е╬└О╪ Д╪ Х╝║Е╝·Ф┬≤Е÷╧Х╝╜О╪┬Е╝·Х╥╣Е╝·Е┼║Г └Г╩⌠Е░┬О╪┴О╪▄Х╝╘Д╫═Г°÷Г°÷Ф╜ёФ╜ёД╫⌠Д╪ Е┬╟Е╕┌Д╫∙Д╦▀Ф┴▀Е│ Х╢╕О╪▄Е╕┌Д╫∙Е©╚И─÷Х╦▐Е┘╔Д╪ Х╝║Х║▄Д╦ Ц─┌Ф╣▌Е╝│Е∙├И│⌠Х╢╒Е┼║Г╝║Г░├Е┘╛Е▐╦Д╦╬Е┼·Д╪ Х╝║Е╝·Ф┬≤Е÷╧Х╝╜Г▐╜Ц─┌Е∙├И│⌠Х╢╒Е┼║Г╝║Г░├Е┘╛Е▐╦Е┤╜Е─÷И⌡└Е▌ Г └Е╦┬Х╣└Е┼⌡И┤▐Ц─│И╒├Е┘┬Г └Е╝·Х╥╣Г╩▐И╙▄Ц─│Д╦╔Х╟╗Г └Ф∙≥Е╜╕Д╫°Иё▌Ц─│Г│╣Ф╢╩Е╓ Ф═╥Г └Ф∙≥Е╜╕Ф√╧Е╪▐О╪▄Х╣╒Е╬≈Д╨├Ф∙╟Д╦┤Е░█Ф√╟Х─│Е╜╕Е▒≤Г └Х╣·Х╣▐Ц─┌Е∙├И│⌠Х╢╒Е┼║Е÷╧Х╝╜И┐╗Г▌╟Е╥╡Ф┬░Д╦╨Д╪ Х╝║Е╟╠Д╦ Е┴█Ф°─Ф²┐Е╗│Г └Д╪ Х╝║Е╝·Ф┬≤Е÷╧Х╝╜Ф∙≥Х┌╡Е÷╨Е°╟Ц─┌<br />Б≈├Ф▀⌡Г■÷Е╞╧Х╠║<br />Д╪ Х╝║Е╝·Ф┬≤Г▐╜О╪ Е╓╖Д╦╜Д╦⌠И≥╒Ф═║Е╨■Е╠┼Ф╞∙Д╦ Г■÷Ф┬√Е╥╡Г╩▐Х▌╥Е╬≈Д╪ Х╝║Е░└Д╦╙Х│▄Г╖╟Д╦█Д╪ Е╝·И≥┘Ф⌠█Д╫°Ц─│Г├÷Ф┌┴Е÷╨Ф°╛Г╖▒Г⌡╝Г └Е╜╕Е▒≤Ф┐ЁФ⌡╢Ф╥╠Д╦─Ф╜╔Д╨├Х╖ёД╪ Х╝║Ц─│Д╩▌Д╨▀Д╪ Х╝║Ф┬√Е┤╨Г╨ЁЕ╥╔Д╫°Г └Е╜╕Е▒≤О╪⌡Ф┐ЁЕ©╚И─÷Х©⌡Е┘╔Д╪ Х╝║Х║▄Д╦ Г └Д╨╨Её╚О╪⌡Д╦█Г├÷Ф┌┴Е┘╗Е╔≈Х╢╕Е┼║Ц─│Г╨ЁГ╗▌Г■ЁФ┼╔Е╝·Е┼║Ц─│Е╒·Е─╪Г╗▌Е▐▒Г╔╗Х╝╓Х╞│Ц─│Х╢╒Е┼║Х╫╞Д╩╤Е╨■Г■╗Г └Х╢╒Е┼║Д╨╨Е▒≤Ц─┌Е╜╕Х╢╧1000<br />Д╪ Х╝║Е╝·Х╥╣Г▐╜О╪ Е÷╨Ф°╛Е┼÷Ф▌▄Ф▐║Ф┴▌Е╝·О╪▄Г╪╨Е╟▒Е░█Е╦┬Е│ Ф▄┤Г┌╧О╪▄Ф▌╔Е▐≈Х┐╫Е┼⌡Ф╞■Х╬┐Е╪╨Г └Е╜╕Е▒≤Ц─┌<br />Д╪ Х╝║Д╦╩Г╝║Е÷╧Х╝╜О╪   Е╜╕Х╢╧3000<br />Е÷╧Х╝╜Е├┘Е╝╧О╪ <br />Ц──1Ц─│Е╥╔Д╦ Д╪│Д╦ Е┘╗Е╔≈Х╢╕Е┼║Е╓└Г░├О╪⌡<br />Ц──2Ц─│Е∙├Х╢╦Д╪│Д╦ Е┘╗Е╔≈Х╢╕Е┼║Е╓└Г░├О╪⌡<br />Ц──3Ц─│Ф°█Е┼║Д╦ Е┘╗Е╔≈Х╢╕Е┼║Е╓└Г░├О╪⌡<br />Ц──4Ц─│Е╒·Е─╪Г╗▌Ц─│Х░╔Д╦ Г╗▌Ц─│Д╪│Д╦ Ф┴─Е╬≈Г╗▌Ц─│Д╦╙Д╨╨Ф┴─Е╬≈Г╗▌Х╝║Г╝≈Ц─│Ф┼╔Х║╗Е║╚Е┬╤Е▓▄Г╫▒Д╦┼Г■ЁФ┼╔О╪⌡<br />Ц──5Ц─│И┤▒Х²╤Е▓▄Г■╗Е▐▀Х╫╞Д╩╤Д╫©Г■╗О╪⌡<br />Б≈├Е╦┬Х╣└Д╩▀Г╩█<br />Ф²╗Е╓╖Ф≤▌О╪ Ф╣▌Е╝│Е∙├И│⌠Х╢╒Г╗▌Е▓╗Х╞╒Ф°┴И≥░Е┘╛Е▐╦Е┬⌡Е┼·Д╨╨О╪▄Ф≈╘Е╧╢Ф╞∙Д╦ Д╨▌Е╓╘Ф╢╔Е╥╔Д╦ Е╓╖Е╜╕Д╪ Х╝║Д╦⌠Д╦ О╪▄1998Е╧╢Е╪─Е╖▀Д╩▌Д╨▀Х╢╒Е┼║Е▓╗Х╞╒Ц─│Е╝║Х╝║Е╥╔Д╫°О╪▄1998Е▐√Е╬≈Д╦╜Е⌡╫ФЁ╗Е├▄Д╪ Х╝║Е╦┬Х╣└Ф═╪О╪▄Е°╗Е╥╔Д╦ Ц─│Ф╣│И─ Д╦ 