INSERT INTO `f_info` VALUES ('214', '3', '506', 'Е╠╠Д╦°Х║║Е╓╘Ф▀⌡Ф═┤Е▓╗Х╞╒Ф°┴И≥░Е┘╛Е▐╦Ф▀⌡Х│≤', 'Е╠╠Д╦°Х║║Е╓╘Ф▀⌡Ф═┤Е▓╗Х╞╒Ф°┴И≥░Е┘╛Е▐╦Ф▀⌡Х│≤Д╩╔Д╦▀Д╨╨Е▒≤О╪ <br /><br />Ф√┤Е▒≤3Е░█;Г╫▒Г╩°Д©║Ф│╞Ф║ёФ║┬Г╝║Г░├Е▒≤3Е░█;<br /><br />Д╦╩Ф▄│Д╨╨3Е░█;<br /><br />Д©║Ф│╞Е▒≤6Е░█;<br /><br />Г╩▐Х░╔И┐╗Г╩▐Г░├6Е░█;<br /><br />Е▄╨Е÷÷Г╩▐Г░├6Е░█;<br /><br />Д╦⌠Д╦ Д╪ Х╝║3Е░█;<br /><br />Е┤╨Г╨Ё3Е░█;<br /><br />Е▐╦Ф°╨3Е░█О╪▄Х╕│Ф╠┌О╪ 3Е╧╢Д╩╔Д╦┼Е╥╔Д╫°Г╩▐И╙▄Ц─┌<br /><br />И╚≤Г╝║3Е░█О╪▄10Е╧╢Д╩╔Д╦┼Е╥╔Д╫°Г╩▐И╙▄Ц─┌<br /><br />Ф√┤Г╖≤3Е░█<br /><br />Ф─╩Г╩▐Г░├Е┼╘Г░├3Е░█О╪▄3Е╧╢Д╩╔Д╦┼Е╥╔Д╫°Г╩▐И╙▄О╪▄<br /><br />Е╥╔Г╗▀И─═Д╩╥Д╦⌠Д╦ Ф┼─Ф°╞Д╨╨Е▒≤6Е░█О╪▄3Е╧╢Д╩╔Д╦┼Е╥╔Д╫°Г╩▐И╙▄Ц─┌<br /><br />ФЁ╗Е├▄Е▓╗Х╞╒И─═Д╩╥Е╦┬5Е░█О╪▄3Е╧╢Д╩╔Д╦┼Е╥╔Д╫°Г╩▐И╙▄Ц─┌<br /><br />Ф▀⌡Ф═┤Д╩ёГ░├Д╦⌠Д╦ Ф┼─Ф°╞Д╨╨Е▒≤2Е░█О╪▄3Е╧╢Д╩╔Д╦┼Е╥╔Д╫°Г╩▐И╙▄Х─┘Д╪≤Е┘┬Ц─┌<br /><br />Е┴╞Ф─╩Г╩▐Г░├2Е░█О╪▄5Е╧╢Д╩╔Д╦┼Е╥╔Д╫°Г╩▐И╙▄Ц─┌<br /><br />Г╩╪Е░┬Г▐╜Д╦╩Д╩╩3Е░█О╪▄5Е╧╢Д╩╔Д╦┼Е╥╔Д╫°Г╩▐И╙▄Ц─┌<br /><br />Ф┼─Ф°╞Ф─╩Г⌡▒3Е░█О╪▄5Е╧╢Д╩╔Д╦┼Е╥╔Д╫°Г╩▐И╙▄Ц─┌<br /><br />Ф■©Е╨°И┤┤Х╢╜Д╦ Е┼║И┐╗Д╦╩Д╩╩3Е░█О╪▄5Е╧╢Д╩╔Д╦┼Е╥╔Д╫°Г╩▐И╙▄Ц─┌<br /><br />Е┼·Д╨▀Е╓└Д╦╩Д╩╩3Е░█О╪▄5Е╧╢Д╩╔Д╦┼Е╥╔Д╫°Г╩▐И╙▄Ц─┌<br /><br />Ф┬©Е°╟Д╨╖Х░╔И■─Г╜√Е┬▓Д╨╨Е▒≤3Е░█О╪▄3Е╧╢Д╩╔Д╦┼Е╥╔Д╫°Г╩▐И╙▄Ц─┌<br /><br />ФЁ╗Е├▄Е▓╗Х╞╒Е╦┬Ц─│ФЁ╗Е├▄Х╞└Д╪╟Е╦┬Ц─│ФЁ╗Е├▄И─═Д╩╥Е╦┬Ц─│ФЁ╗Е├▄Г⌡▒Г░├Е╦┬Е░└3Е░█О╪▄3Е╧╢Д╩╔Д╦┼Е╥╔Д╫°Г╩▐И╙▄Ц─┌<br /><br />Х╕│Ф╠┌О╪ <br /><br />1Ц─│Е╨■Х│≤Д╨╨Е▒≤Е⌠│Х╡▄Г╚╞Ф╜ёЦ─│Е░┐Х▀╕Х─░Е┼ЁЦ─│Ф╡÷И─ Х┐╫Е┼⌡Е╪╨Ц─│Ф≥╝И─ Х╞²Ф═┤Е┤├Ц─│Ф°┴Д╦─Е╝ Г └Г╓╬Д╪ Х╣└Ф╨░Ц─│Ф°┴Е╪─Ф▀⌠Г╡╬Г╔·Ц─│Г╩└Г╩┤Е█▐Х╟┐Х┐╫Е┼⌡Е╪╨Ц─┌<br /><br />2Ц─│Е╨■Х│≤Д╨╨Е▒≤Д╦⌠Г╖▒Д╩╔Д╦┼Е╜╕Е▌├О╪▄Х┤ЁЕ╟▒Д╦─Е╧╢Д╩╔Д╦┼Е╥╔Д╫°Г╩▐И╙▄О╪▄Ф°┴Г⌡╦Е┘ЁЦ─│Г⌡╦Е░▄Г╩▐И╙▄Ф┬√Д╦⌠Д╦ Х─┘Д╪≤Е┘┬Ц─┌<br /><br />Ф°┬Х√╙1000Е┘┐Д╩╔Д╦┼О╪▄Е╡≈Д╫█Д╦█Е░▄Е╥╔Х╣└Д╦█Е░▄О╪▄Е┘╤Д╩√И²╒Х╝╝Ц─┌', '', '0', '1271920150', '1271920150', '', 'Е╬░Х─│Е╦┬Ц─│Е├╞Х─│Е╦┬', '2284666', '', '127.0.0.1', '0', '1');
