INSERT INTO `f_info` VALUES ('247', '3', '570', 'Ф▀⌡Х│≤Х╫╕Е╥╔Ц─│Ф°╨Ф╒╟Ф⌠█Д╫°Е╥╔Ц─│И▓ЁЕ╥╔Ц─│Г└┼Е╥╔Ц─│Е╜╕Е╬▓Е╥╔', 'Х╫╕Е╥╔О╪▄Ф°┬Х√╙1800Е┘┐Д╩╔Д╦┼О╪⌡Ф°╨Ф╒╟Ф⌠█Д╫°Е╥╔О╪▄1500Е┘┐Д╩╔Д╦┼О╪⌡Г└┼Е╥╔О╪▄1800Е┘┐Д╩╔Д╦┼Ц─┌', '', '0', '1271920165', '1271920165', '', 'Е╜■Е┘┬Г■÷', '15964123344', '', '127.0.0.1', '0', '1');
INSERT INTO `f_info` VALUES ('248', '3', '534', 'Ф╣▌Е╝│Х©°Е╓╖Ф∙≥Х┌╡Ф▀⌡Х│≤Х▀╠Ф≈╔И÷╘ФЁ∙Е┘╪Х│▄Ф∙≥Е╦┬', 'Х│▄Д╫█Х╕│Ф╠┌О╪ <br />Е╦┬Х▄┐Г╠╩Е╜╕Ф═║Ф╞∙Д╦ О╪▄Ф°╛Г╖▒Е▐┼Ф°╛Г╖▒Д╩╔Д╦┼ <br />Х▀╠Х╞╜Ф∙≥Е╦┬И║╩Ф▄│Ф°┴Д╦⌠Д╦ 8Г╨╖Х╞│Д╧╕<br />Ф≈╔Х╞╜Ф∙≥Е╦┬И║╩Ф▄│Ф°┴jpt1Г╨╖Х╞│Д╧╕<br />И÷╘Х╞╜Ф∙≥Е╦┬И║╩Ф▄│Ф°┴topik6Г╨╖Х╞│Д╧╕<br />Ф≥╝И─ Х╞²Ф═┤Е┤├О╪▄Е╫╒Х╠║Ф╟■Х╢╗Д╫Ё<br />Г┐╜Г┬╠Ф∙≥Е╜╕Д╨▀Д╦ О╪▄Ф°┴Х╢ёД╩╩Е©┐О╪▄Ф°┴Х─░Е©┐О╪▄Е√└Д╨▌Д╦▌Е╜╕Е▒≤Ф╡÷И─ Ц─┌<br />Ф°┴Г⌡╦Е┘ЁЕ╥╔Д╫°Г╩▐И╙▄Х─┘Д╪≤Е┘┬<br /><br />Е╥╔Д╫°Х│▄Х╢ёО╪ <br />Е┘╥Е╓┤Х┴╞Е╔╫Г └Е╦┬Е╬╥О╪▄Х╝╓Г°÷Ф▌┬Х╞╬<br />Г╖╞Ф·│И┘█Е░┬Е▐┌Д╦▌Е╜╕Ф═║Е╝ Ф°÷Е▐╛Е╪─Г └Ф∙≥Е╜╕Г═■Х╝╗Д╪ <br />Ф°█Д╩▌Е╜╕Ф═║Ф▌▓Х╞╬Е╝┴Ф▌▓<br /><br />Ф°┴Ф└▐Е░▒Х─┘Х╞╥Ф┼┼Г╝─Е▌├Е▐▒И─│Е┬╟И┌╝Г╝╠5337feiyangО╪═sinaЦ─┌comО╪▄Е°╗Г╝─Е▌├Д╦╜Х║╗Ф≤▌Д╦╙Д╨╨Х│■ГЁ╩Г■╣Х╞²О╪┬Ф°─Е╔╫Ф≤╞Ф┴▀Ф°╨О╪┴Е▓▄Д╦╙Д╨╨И┌╝Г╝╠О╪▄Д╩╔Ф√╧Д╬©Е▐┼Ф≈╤И─ Г÷╔И²╒Х╞∙Ц─┌<br />И²╒Х╞∙Ф≈╤И≈╢О╪ Ф╞▐Е▒╗Д╨▄Ц─│Е▒╗Д╨■14О╪ 30 <br />Е°╟Е²─О╪ Ф╣▌Е╝│Е╦┌Г░╣Г░╤Е╠╠Е▄≈Х╥╞29Е▐╥О╪┬Д╨▄И≥╒Х╔©Д╦╢О╪┴', '', '0', '1271920165', '1271920165', '', 'Г©÷Х─│Е╦┬', '0537-2316565', '', '127.0.0.1', '0', '1');
INSERT INTO `f_info` VALUES ('249', '3', '521', 'Х╞ Ф▀⌡Е█│Д╨▄Е▌©Е╦┌Е▄╨Д╦ Е┼║Д╨╨Е▒≤Е▐┼Д╩ёГ░├Е∙├', 'Г┐╜Г┬╠И┤▒Х·█Х║▄Д╦ О╪▄Е╨■Г∙▄Ф╞∙Д╦ Г■÷О╪▄Ф°┴Х┌║Г╔╗Ц─│Ф°÷Х╢╖Ц─│Д©²И≥╘Г╜┴И┤▒Х·█Х║▄Д╦ Е╥╔Д╫°Г╩▐И╙▄Х─┘Д╪≤Е┘┬Х─┐Х≥▒О╪▄Д╦─Г╩▐Е╫∙Г■╗О╪▄Е╬┘И│┤Д╦╟Е▌ О╪▄Е┘╛Е▐╦Е▐╞Ф▐░Д╬⌡Д╦⌠Д╦ Е÷╧Х╝╜О╪│<br />Е░▄Ф≈╤Ф╛╒Х©▌Е╧©Е╓╖Ф┼∙Х╣└Х─┘Е┴█Ф²╔Е▓╗Х╞╒О╪▄Ф┌╗Г └Г╗ЁЕ╝ Ф■╤Г⌡┼Ф≤╞Ф┬▒Д╩╛Г └Г⌡╝Ф═┤О╪▄Е┘╛Е▐╦Г²─И┤█Д╨▌Г └Е╝╒Ф┬╥Е÷╧Х╝╜Е▐┼Е╝╒Ф┬╥Г╩╢Ф┼╓Ф√╧И²╒О╪▄Х╝╘Ф┌╗Г°÷Ф╜ёФ┼┼Ф▐║Е╦┌Е°╨Х╖└Е╬▀О╪▄Х╫╩Ф²╬Х▌╥Е┬╘О╪│О╪│О╪│<br />Х╞╕Ф┐┘Х╞╥Г≥╩И≥├Е╠╠Д╦°Е╓√Ф╠┤Г╫▒Б─■Г┴╧Х┴╡Ф°█Е┼║О╪│О╪│О╪│<br />', '', '0', '1271920166', '1271920166', '', 'Е╝▀Е┘┬Г■÷', '15054879919', '', '127.0.0.1', '0', '1');
