INSERT INTO `f_info` VALUES ('752', '3', '60', 'Г╩≥Д╫═Ф┬▒Е┘╗Ф√╟Г └Д╦√Г∙▄О╪┬Е⌠│Е▒ЁЕ╔ЁЕё╚Х╞ Х╖┘Ф°┴Г╪≤Д╪╢Д╬ёО╪┴', 'Ф°╛Д╨╨Е█∙Х╨╚Ф°╙Х┌╡О╪▄Е╧╢Х╫╩Х╢╓Ф╥▒О╪▄Г╚╞Е╨└Ф╦┘И⌡┘О╪▄Д╫°Иё▌Ф╜ёФ╢╬О╪▄Е╝╤Е╒┐Е╔╫О╪▄И┤█Ф┐┘Г┬╠<br><br>Е╝╤Ц─┌Е√°Ф╛╒Ф√┤Е╜╕И÷ЁД╧░Ц─┌Ф╛╡Е╞╩Ф²║Д╩╤Г⌡╦Д╩©О╪▄Е╪─Ф°≈И ▐Е▓▄О╪▄Ф°┴Ф╤╣Е┘╩О╪▄Ф≤▌Д╨▀Г░├Г └Г■╥<br><br>Её╚Д╦╨Г╩┬Г■÷Д╪╢Д╬ёО╪▄Ф┴⌠Г╝≈Г╩⌠Е╘ Х─┘Д╪≤Е┘┬Х─┐Х≥▒Ц─┌Ц─░Ф²║Д╩╤Е╔╫Е╦╕Д╦─Е╜╘Е╜░Д╧÷Е▐╞Ц─▒<br><br>Ц─░Г⌡╦Г╨╕Ф≈╤Х╞╥Е╦╕Х╞│Д╩╤Х╞│Е╝·Х╨╚Д╩╫Ц─┌Г■╣Х╞²Е▐▒Д©║Ф│╞13455596400О╪▄<br><br>Ф≈╤Х╞╥ФЁ╗Ф≤▌Ф╣▌Е╝│Д©║Ф│╞Ф╦╞Ц─┌Е░╕Х─┘Е┘█Х│┼Ц─▒Ц─┌<br><br>Ф≈═Х│┼Х─┘Ф┬√Х─┘Ф°┴Е╝╤Е╨╜Х─┘Х╞╥Е▀©Ф┴╟О╪│<br><br><br><br>Е├≥Г╩≥Ф°─И╜┘Е┼⌡Г └Д╫═<br><br>Д╦┼Е╦²Д╦╨Д╨├И─═Е╟╠Д╦─И┐╗Ф²╟Д╫°<br><br>Г┴╧Ф└▐Е°╗Д╫═Ф┬▒Д╧▀И≈╢Ф╢▓Д╦▀Д╨├<br><br>Д╦┤Ф╟╢Е█┐Е╠╠Г └Гё╗И ╬<br><br>Е▓▄Ф╡│Д╨╨Е©┐Х└╬Г └Г▌╚Г▒╟Е⌡╜<br><br><br>Д╦╨Е≈┘Е┬╟Ф╟╦Д╧┘Г └Х┼╠И╕≥<br><br>Ф┬▒Д╩╛Е╪─Е╖▀Д╨├Е©┐Г≈⌡Ф≈┘И─■<br><br><br>Д╦─Д╦²Д╦²Г └Г┴╣Ф▄┌<br><br>Ф≤╞И╩▒Е╓°И┤▄Ф≤▌Ф°┬<br><br>Д╦─Д╦²Д╦²Г └Ф┐ЁЕ©╣<br><br>Ф≤╞Г√╡Ф┐╚Г └Х║╬Х╒╚<br><br><br>Г╜┴Е╬┘Д╧÷Ф≤╞Е╧╦Г╕▐<br><br>Г│╣И╜┌Д╦█Е├█Е╜╓Г▀╛<br><br>Ф╣│Е╓╠Г └Е╡│Ф°┬И┤▄<br><br>Е⌡═Д╦╨Ф°┴Д╨├Г░├Ф┐Ё<br><br>Д╦─Д╦╙Д╨╨Ф┴█Х©≥Д╧┬Г╬▌Е╔╫<br><br>Д╩╩Е┤╜Ф≈╤Г╘╨Г └И│╔Х©°<br><br>Г┤┐Г┐╖Г └Д╬²Г└╤Ф≤╞<br><br>Е©┐Д╦▌Е©┐Г╒╟Ф▓·Г └Г│╚Х┼╠<br><br><br><br>Ф┐ЁХ╠║Д╫═И┌ёФ╦╘И⌡┘Г └Г╛▒И╒°<br><br>Е╟├Ф┬▒Ф┴─Ф°┴Г └Е╪╠Г┌╧<br><br>Е▄√Д╦╨Ф°─Д╨╝Д╦╫Г └Г╬▌Ф≥╞<br><br>Ф└÷Ф│╘Ф≤╔Е╓╘Х╝╘Ф┬▒<br><br>Ф▀┌Е▌╩Д╫═Е©┐Г│╣Г └Д╪╓Г≈∙<br><br>Г■÷Е▒╫Г └Ф≈┘И─■Д╦╜<br><br>Ф°┴Д╫═Г⌡╦Д╪╢<br><br>Е─█Е┼═Г▐█Ф┐°Д╫═<br><br>Е⌡═Д╦╨Х©≥Ф≤╞Е╝╧Ф≤⌠Е▐≈Д╪╓Г └Е©┐<br><br>Д╧÷Ф≤╞Ф╒┘И⌡╙Ф└▐Е©≈Е©┐Г └Ф°÷Г⌡╪<br><br><br><br>Ф╦╢Ф°⌡Г°╪Г²⌡Д╦▌Г°╪Г²⌡Г └И┤█И─╒<br><br>Д╫═Г └Е┘ЁФЁ╗Г┌╧Г┤┐Г■÷Е▒╫Г └Г╞²Г│╚<br><br>Г■╗Г°÷Ф┐┘Ф┼▓Е├≥Г┬╠Г └Г╞┤Г╚═<br><br>Г╔²Г╕▐Е©┐Ф└©Д╦─Ф═╥Г └Ф┬▒Д╩╛<br><br>Е°╗И┤┼Ф──Д╦╜Д╦█Ф°÷Х─▄И│┤<br><br>Е╟│Е╜≤Г └Ф°─Г╬▌Г └Г▌╚Г▒╟Х┼╠Е⌡╜<br><br>Ф≤╞Д╦╨Е╘ Е╖╩Д╦╜Ф°─Г╬▌Г └Д╫═Иё≤И╕≥<br>', '', '0', '1271984053', '1271984053', '', 'Ф°┬Д╦┼Ф÷ЁФ╒╒', '13455596400', '', '127.0.0.1', '0', '1');
