INSERT INTO `f_info` VALUES ('788', '3', '59', 'Е╞╩Х╖┘Г│╣И╜┌Д╪╢Д╬ёО╪┬Е╔ЁЕё╚Е╬│Е╘ О╪┴', 'Ф°╛Д╨╨Ф╦┘И⌡┘Х╢╓Ф╥▒О╪▄И²▓Ф≤╔Д╨╝Д╦╫О╪▄Г÷╜Е╘ Ф°╙Х┌╡О╪▄Д╨▀Д╦ Е█∙Д╫█Е├┘И──О╪▄Д╪═Г╩÷И┤█Ф┐┘О╪▄<br><br>Г⌡╦Д©║Иё·Х╤┼Е├╟И⌡╙Г └Ф╒┘И╜┌Ф⌡╢Ф°┴Е├┘Ф╤╣О╪▄Иё·Х╤┼Е╠╠Е╥┘Г └Г©┘Х├─Ф⌡╢Е┼═Г÷╚Е│╔Ц─┌Д╫═Х▀╔Х┐╫<br><br>Е╔┴Г▄╝Д╫═И≤ЁЕ┘┴Г └И≈╝Е─≥О╪▄Ф┬▒Д╪ Х©≤Д╫═Е╠╠Ф╦┘Ф╟╢Г╖─Е╔┤Д╦╫Ф≤╔Е╦╦Е°╗Г └Е╒┐Г∙▄Ц─┌<br><br>ФЁ╗И┤█Е├┘Е°╗Г └Е┘╠И╦ёГ └Ф─²Ф┐ЁД╨╓Ф╣│Ц─┌Е╞╩Х╖┘И ▐Е▓▄Д╫⌠Х╢╢О╪▄Ф≤▌Д╨▀Г░├О╪▄Х╬╘Ф≤╞И²·О╪▄Г⌡╦Д╨▓<br><br>Ф┴╤Ф▄│О╪▄И┤█Ф┐┘Ф╜ёФ╢╬О╪▄Д╦╨Г°÷Е√└Е╝┬Е─≥Г └Г│╣И╜┌Д╪╢Д╬ёЦ─┌Е▄╨Е÷÷Д╦█И≥░Ц─┌Ф°┴Ф└▐Х─┘Х╞╥Е°╗<br><br>13455596400Г■╣Х╞²Г÷╜Д©║Д╦┼О╪▄Ф┬√Х─┘qq1063022091Д╦┼Г∙≥Д╦▀Д╦╙Д╨╨Х╣└Ф√≥,<br><br>Ф┐┘Е├╣Д╦█Х╞╕Х─┘О╪▄Ф▀▓Г╩²Е⌡·Д©║Ф│╞Ц─┌<br><br>Ц─░Г⌡╦Г╨╕Ф≈╤Х╞╥Е╦╕Х╞│Д╩╤Х╞│Е╝·Е░└Х┤╙Х╨╚Д╩╫Ц─▒О╪▄Ц─░Ф°┴Е╝╤Е╨╜Х─┘Х╞╥Е▀©Ф┴⌠Ф┴╟Ц─▒<br><br>Е┴█Г╪≤Д╩┼Г■÷ <br><br>Д╨╨Х▀╔Х┐╫Х╫╛Д╦√О╪▄<br><br>И┌ёД╧┬О╪▄<br><br>Ф┬▒Д╩╛Е┴█Г■÷Ф⌡╬Г╩▐Ф≤╞Д╩─Д╧┬О╪÷ <br><br><br>Ф┬▒Х▀╔Ф⌡╬Ф≤╞Ф╠÷Е█≈И┤┤Х▌╡Г └Е╔ЁЕ╜░О╪▄<br><br>Д╫═Е©┘Ф≤╞Ф┬▒Г╨╓Х┘∙Д╦▀И■≥Х©┤Г └И┌ёД╦─Ф°╣Ц─┌<br><br>Д╫═Х▀╔Ф⌡╬Ф≤╞И┌ёД╦╙И─┐Е╜╕Г └И║╫Г╚╔О╪▄<br><br>Ф┬▒Е©┘Ф≤╞Д╩▌Д╫═Х╒▀Д╦╜Ф▌┴Х░╫Г └И┌ёИ╒≈Е╢╜Ф√╟Г └Е╪╧Г▐═О╪▄<br><br>Е°╗Х╥╞Ф≈│Х█┴Д╦⌡И┤▄О╪▄<br><br>Г⌡╝И─│Д╫═Ф╞╚Д╦█Г÷╔Ф┐┘Е°╟Х©°Е▌╩Ц─┌<br><br> <br>Д╫═Х▀╔Ф⌡╬Ф≤╞И²╒Её│Г └И╚≤Е┐╖О╪▄<br><br>Ф┬▒Е©┘Ф≤╞Ф╝©Е┴█Г └И┌ёД╦─Г┌╥И╕≥О╪▄<br><br>И≥╙Д╪╢Х©┤Д╫═Д╦─Ф╝╣И²≥Г╘├Г └Ф≈╤Е┘┴Ц─┌<br><br><br>Е⌡═Ф╜╓О╪▄<br><br>Д╩┼Г■÷Г⌡╦И─╒Ц─┌<br><br>Г╩▐Е▌├Ф╡╖Ф╣╥Ф║▒Г■╟Г └Ф≈╤Г╘╨О╪▄<br><br>Е┤╓Е┤╟Ф╤┘Г⌡≤О╪▄<br><br>Е┘╤Г╔·Ф╡│Д╨╨Е©┐Х└╬О╪▄<br><br>Е┘╤Г╔·Е┼╗Д╨╨Е©┐И╜└Ц─┌<br><br>Е┤║Е╟≤Д╦╓Е©≤О╪▄<br><br>Е╝⌡Е╕┌Д╩≥Е╒┐Ц─┌', '', '0', '1271984071', '1271984071', '', 'Ф°┬Д╦┼Ф÷ЁФ╒╒', '13455596400', '', '127.0.0.1', '1', '1');
