INSERT INTO `f_info` VALUES ('809', '3', '59', 'Г╔²Х╢╨Б─°Ф╣▌Е╝│И╧┼Ф║╔Д╪ Е█∙Х╨╚Ф╢╬Е╞╧Ф√┤Е▄√Х┼┌Е°├Ф╩║Ф┬░Е┼÷О╪│Б─²', '<br> <br>Г╔²Х╢╨Б─°Ф╣▌Е╝│И╧┼Ф║╔Д╪ Е█∙Х╨╚Ф╢╬Е╞╧Ф√┤Е▄√Х┼┌Е°├Ф╩║Ф┬░Е┼÷О╪│Б─²<br>Ф╣▌Е╝│И╧┼Ф║╔Д╪ И╕√Е╠┼Е█∙Х╨╚Ф╢╬Е╞╧Ф√┤Е▄√Х┼┌Д╨▌2009Е╧╢12Ф°┬20Ф≈╔Д╦▀Е█┬Е°╗Ф╣▌Е╝│И╩└Ф╥╝Е╝╬И╕├И ├И┤█Д╦╬Х║▄Ц─┌<br>Д╦╩Е┼·Е█∙Д╫█О╪ Ф╣▌Е╝│Е╦┌Е╦┌Д╦╜Е▄╨Ф─╩Е╥╔Д╪ Ц─│Е╕┤Х│■Ц─│Е⌡╒Е▄╨Е╖■<br>Ф┴©Е┼·Е█∙Д╫█О╪ Д╦╜Е⌡╫И╧┼Ф║╔Д╪ Ф╣▌Е╝│Ф─╩Г╚≥О╪┬Ф╣▌Е╝│И╧┼Ф║╔Д╪ О╪┴<br>Е▐┌Е┼═Д╨╨Е▒≤О╪ Д╩╔Ф°╨Е┘ЁД╨▀Д╦ Ц─│Е╓╖Д╦╜Е·▀Д╪│Д╦ Е█∙Д╫█Х│▄Е╥╔Д╦╨Д╦╩О╪▄Е┘╠Х©▒Д╨■Г≥╬Д╨╨Ц─┌<br>Д╨╨Е▒≤Е╜╕Е▌├О╪ 80%Д╩╔Д╦┼Д╦╨Е╓╖Д╦⌠Д╩╔Д╦┼Е╜╕Е▌├О╪▄Е┘╤Д╦╜И┐╗Е┬├Е┘╥Ф°┴Г═■Г╘╤Г■÷Е╜╕Е▌├Ф┬√Х─┘Г║∙Её╚Е╜╕Д╫█Ц─┌<br>Е┤╨Е╦╜И╒├Е╞╪О╪ Ф╣▌Е╝│Е╦┌Д╦╜Е▄╨Е╕┤Х│■Д╦╩Е╦╜Е╪═Ф≤╔Х▄╧Ц─│Е╦┌Д╦╜Е▄╨Ф─╩Е╥╔Д╪ Е┴╞Д╦╩Е╦╜Е╪═Гё┼Ц─│Д╦╜Е▄╨Е⌡╒Е╖■Е┴╞Д╧╕Х╝╟Е├╞Е╩╤Е╝│Е┤╨Е╦╜Д╨├Ф╢╬Е╞╧Ф√┤Е▄√Х┼┌Ц─┌Е╪═Ф≤╔Х▄╧Д╦╩Е╦╜Д╩ёХ║╗Д╦╩Е┼·Е█∙Д╫█Х╝╡Х╞²Ц─┌<br>Г⌡╝Г └Ф└▐Д╧┴О╪ Е╦┌Д╦╜Е▄╨Е╕┤Х│■Д╦╩Е╦╜Е╪═Ф≤╔Х▄╧Е°╗Х╝╡Х╞²Д╦╜Ф▄┤Е┤╨О╪▄Г⌡╝Г └Ф≤╞Д╦╨Д╨├Х©⌡Д╦─Ф╜╔Х╖ёЕ├ЁГ╓╬Д╪ Е░└Г∙▄Е█∙Х╨╚Д╨╨Её╚Г └Е╘ Ф│▀И≈╝И╒≤О╪▄Д©┐Х©⌡Е▓▄Х╟░Г╓╬Д╪ Е╩╨Х╝╬Ц─┌Е╦▄Ф°⌡Х©≥Ф╛║Ф╢╩Е┼╗Х┐╫Д╦╨Е╓╖Е╝╤Ф▐░Д╬⌡Д╦─Д╦╙Ф╡÷И─ Д╨╓Ф╣│Г └Е╧ЁЕ▐╟О╪▄Г╩⌠Х╞├Ф°▀Е▐▀О╪▄Ф┴╬Е┬╟Ф└▐Д╦╜Д╨╨О╪▄Е╦▄Ф°⌡Ф╣▌Е╝│И╧┼Ф║╔Д╪ Д╩┼Е░▌Е┘┘Е┬├Е▐▒Ф▄╔Г╓╬Д╪ Е╘ Д╩▀Ф°╨Ф·└Г └Д╫°Г■╗О╪▄Е╒·Е╪╨Г╓╬Д╪ Х╢ёД╩╩Ф└÷О╪▄Х╞ Д©║Д╦╨Ф°╛О╪▄Д╦╨Е▓▄Х╟░Г╓╬Д╪ Е╩╨Х╝╬Е│ Е┤╨Х┤╙Е╥╠Е╨■Ф°┴Г └Х╢║Г▄╝О╪│<br>Ф╢╩Е┼╗Е╝┴Ф▌▓О╪ <br>1Ц─│Ф┴©Е┼·Е█∙Д╫█Д╦╜Е⌡╫И╧┼Ф║╔Д╪ Ф╣▌Е╝│Ф─╩Г╚≥О╪┬Ф╣▌Е╝│И╧┼Ф║╔Д╪ О╪┴И┌╠Е╗÷Д╦╩Д╩╩Х┤╢Х╬·Ц─┌<br>2Ц─│Д╦╩Е┼·Ф√╧Д╩ёХ║╗Е╦┌Д╦╜Е▄╨Е╕┤Х│■Д╦╩Е╦╜Е╪═Ф≤╔Х▄╧Х╝╡Х╞²<br>3Ц─│Е█▐Е┼·Ф√╧Х╢╣Ф≈▐Е╓╘Д╫©Е╘ Г╨╠Ф▒└Е╫╠Ф°┴И≥░Е┘╛Е▐╦Х▒ёД╨▀И∙©Ф²▌Г╩╖Ф╟▒Х┤╢Г╔²Х╢╨Х╞█<br>Ф╣▌Е╝│Е╦┌Г■╣Х╖├Д╦─Е▐╟Б─°Г⌡╢Ф▓╜Ф╟▒Г■÷Б─²21Ф≈╔Ф≥ 6Г┌╧05Е┬├Е▓▄Д╨▄Е▐╟9Г┌╧25Е┬├Ф┼╔И│⌠Д╨├Ф╢╩Е┼╗Г▌╟Е°╨О╪▄<br>Ф╣▌Е╝│Е╦┌Е╦┌Д╦╜Е▄╨Г■╣Х╖├Е▐╟Б─°Г╓╬Д╪ Ф┼╔И│⌠Б─²21Ф≈╔Ф≥ 7Г┌╧45Е┬├Ф┼╔И│⌠Д╨├Ф╢╩Е┼╗Г▌╟Е°╨Ц─┌<br>Ф╣▌Е╝│Ф≈╔Ф┼╔Б─°И┐╫Е╦┌Ф≥╗Е┬┼Б─²Е▓▄Е╠╠Д╦°Е∙├Ф┼╔Г⌡╦Г╩╖Ф┼╔И│⌠Д╨├Ф╢╩Е┼╗Е├┘Е╝╧Ц─┌', '', '0', '1271984083', '1271984083', '', 'Г▌▀Х─│Е╦┬Е╪═Х─│Е╦┬', '26051772605877', '', '127.0.0.1', '4', '1');
